INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49130, 1, 5010002, 'Colorful Rainbow', 'A special effect in which you''ll see a rainbow in its full 7 colors floating next to you. Designate a HotKey to turn the effect on/off.');
