INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49134, 1, 5010006, 'Baby Angel', 'A lovely effect that shows a baby angel floating around as your protector.  Designate a HotKey to turn the effect on/off.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49135, 1, 5010007, 'Fugitive', 'A special effect that puts a poster in front of your face as if you''re being wanted around the world.  Designate a HotKey to turn the effect on/off.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49136, 1, 5010008, 'Mr. Jackpot', 'A special effect used to increase the chance of winning with Slot Machine by 2x. Designate a HotKey to turn the effect on/off.');
