INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49179, 1, 5010056, 'Garden Trail', 'A special effect that features a trail of flowers and grass left behind by the owner of the item. Designate a HotKey to turn the effect on/off.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49180, 1, 5010057, 'Flower Fairy', 'A special effect that shows a cute fairy sprinkling flowers. On the Key Config, configure this on a button of your choice to turn the effect on/off.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49181, 1, 5010999, 'Changing to a Monster', 'Not sold in Cash Shop. An effect shown while changing into a monster.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49182, 1, 5021000, 'Water Balloon', 'A cool blue water balloon. Thrown with a #cthrowing star# to have the water balloon effect. Item cannot be removed.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49183, 1, 5021001, 'Paper Plane', 'A nicely-folded paper plane. Thrown with a #cthrowing star# to have the paper plane effect. Item cannot be removed.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49184, 1, 5021002, 'Energy Ball', 'A ball of concentrated energy. Thrown with a #cthrowing star# to have the energy effect. Item cannot be removed.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49185, 1, 5021003, 'Super Star', 'A red starfish that can be seen at the beach. Can be equipped with a #cthrowing star# to have the starfish effect.  This item cannot be removed.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49186, 1, 5021004, 'Winged Baseball', 'A baseball with small wings attached to it. Can be equipped with a #cthrowing star# to have the winged baseball effect.  This item cannot be destroyed.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49187, 1, 5021005, 'Football', 'The official football of the MapleBowl. When held in your inventory, #cthrowing stars# will appear as a thrown football.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49188, 1, 5021006, 'Chalkboard Eraser', 'A chalkboard eraser commonly found in classrooms. Thrown with a #cthrowing star# to have the eraser effect. Item cannot be removed.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49189, 1, 5021007, 'Shooting Hearts', 'A small pink heart of love that explodes on contact. Thrown with a #cthrowing star# to have the heart effect.   Item cannot be removed.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49190, 1, 5021008, 'Throwing Teddy', 'An adorable brown teddy bear that explodes on contact. Thrown with a #cthrowing star# to have the teddy bear effect.   Item cannot be removed.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49191, 1, 5021009, 'Throwing Pepe', 'Never in Pepe''s wildest dreams did it think it''d be chucked down the field in place of the throwing star. Thrown with a throwing star to have the Pepe effect. Item cannot be removed.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49192, 1, 5021010, 'Mr. Puff Throwing Star', 'A throwing star make to look like Mr. Puff, with its huffy puffy cheeks resembling that of a tasty-looking steamed bun. Thrown with a #cthrowing star# to have the Mr. Puff effect.  Item cannot be removed.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49193, 1, 5021011, 'Skull Striker', 'An enchanted skull straight from the Headless Horseman. Thrown with a throwing star to have the skull striker effect. Item cannot be removed.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49194, 1, 5021012, 'Pumpkin Bomb', 'Harmless pie? Think again. Thrown with a throwing star to have the pumpkin bomb effect.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49195, 1, 5021013, 'Pirate Bomb', 'An explosive bomb used by the legendary pirates. Thrown with a #cthrowing star# to have the explosive bomb effect.  Item cannot be removed.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49196, 1, 5021014, 'Poo Stars', 'That nasty poop can be detected from afar. Thrown with a #cthrowing star# to have the nasty poop effect.  Item cannot be removed.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49197, 1, 5021015, 'Egg Throwing Star', 'A white egg thrown in place of the throwing star, and that explodes on contact. Thrown with a #cthrowing star# to have the Chick effect.   Item cannot be removed.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49198, 1, 5021016, 'Devilball', 'A mischievous ball that has gained sentience, and now lives to be thrown for massive damage. Tremendous striking power! Equips over #cThrowing Stars#!');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49199, 1, 5021025, 'Charm of the Undead', 'Equips over #cThrowing Stars#!');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49200, 1, 5021017, 'Dragon Disc', 'An explosive throwing star used by the Dragon. Thrown with a #cthrowing star# to have the explosive bomb effect.  Item cannot be removed.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49201, 1, 5021019, 'Shooting Star Medal', 'Beautiful shooting star. Mask over #cThrowing Star#.  Item cannot be removed.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49202, 1, 5021020, 'Throwing Boomers', 'Explosive throwing stars from New Leaf City. They''re the Bomb!  This item equips over #cThrowing Stars#!');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49203, 1, 5021021, 'Exploding Sheep', 'A cute and cuddly sheep. Don''t let it fool you--it''s lethal. This item equips over #cThrowing Stars#!');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49204, 1, 5030000, 'Mushroom House Elf', 'Set up this special store on the Free Market, and this Elf, working as the Hired Merchant, will sell the items for the owner, even if the owner does not log on to the game.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49205, 1, 5030001, 'Mushroom House Elf', 'Set up this special store on the Free Market, and this Elf, working as the Hired Merchant, will sell the items for the owner, even if the owner does not log on to the game.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49206, 1, 5030002, 'Cashier: Teddy Bear Clerk', 'Set up this special store on the Free Market, and this Teddy Bear, working as the Hired Merchant, will sell the items for the owner, even if the owner does not log on to the game.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49207, 1, 5030003, 'Cashier: Teddy Bear Clerk', 'Set up this special store on the Free Market, and this Teddy Bear, working as the Hired Merchant, will sell the items for the owner, even if the owner does not log on to the game.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49208, 1, 5030004, 'The Robot Stand', 'Set up this special store on the Free Market, and this Robot, working as the Hired Merchant, will sell the items for the owner, even if the owner does not log on to the game.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49209, 1, 5030005, 'The Robot Stand', 'Set up this special store on the Free Market, and this Robot, working as the Hired Merchant, will sell the items for the owner, even if the owner does not log on to the game.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49210, 1, 5030006, 'Mushroom House Elf', 'Set up this special store on the Free Market, and this Elf, working as the Hired Merchant, will sell the items for the owner, even if the owner does not log on to the game.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49211, 1, 5030008, 'Homely Coffeehouse', 'Set up this special store on the Free Market, and this Coffeehouse, doubling as the Hired Merchant, will be a place that sells the items for the owner, even if the owner does not log on to the game. #cIf an item is sold, the owner will be notified through the chat window.#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49212, 1, 5030009, 'Homely Coffeehouse', 'Set up this special store on the Free Market, and this Coffeehouse, doubling as the Hired Merchant, will be a place that sells the items for the owner, even if the owner does not log on to the game. #cIf an item is sold, the owner will be notified through the chat window.#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49213, 1, 5030010, 'Granny''s Food Stand', 'Set up this special store on the Free Market, and this Granny, working as the Hired Merchant, will sell the items for the owner, even if the owner does not log on to the game.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49249, 1, 5120000, 'Snowy Snow', 'Sprinkles snow on the map where your character is for 30 seconds. Enter a message of your choice.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49214, 1, 5030011, 'Granny''s Food Stand', 'Set up this special store on the Free Market, and this Granny, working as the Hired Merchant, will sell the items for the owner, even if the owner does not log on to the game.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49215, 1, 5030012, 'Tiki Torch Store', 'Set up this special store on the Free Market, and this Granny, working as the Hired Merchant, will sell the items for the owner, even if the owner does not log on to the game.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49216, 1, 5040000, 'The Teleport Rock', 'Remembers 5 maps of your choice. This rock will enable you to #cteleport to the map you remembered#. It can even allow you to #cmove to the map where a certain character is#, provided that the person is in the same channel at the same world. This item cannot be used to teleport in between continents.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49217, 1, 5040001, 'Teleport Coke', 'By drinking sweet refreshing #cCoca-Cola#, it ables you to #cteleport to one of the remembered maps#. You can also #cteleport to the map where specific character is located# in the same channel.  Unable the teleport to the maps where teleport is limited.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49218, 1, 5041000, 'VIP Teleport Rock', 'This Teleport Rock enables one to #cteleport between continents#. It also enables the user to teleport to a specific character from the same channel. Up to #c10# maps, excluding the maps that cannot be reached through teleport, can be registered for this.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49219, 1, 5050000, 'AP Reset', 'This is the #cscroll that allows you to reset 1 AP from the ability stat#. Choose one AP from HP, MP, STR, DEX, INT, or LUK , and allocate it to the desired category. The lowest an AP level can reach on any category is 4.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49220, 1, 5050001, 'SP Reset (1st job)', 'This scroll allows you to #creset 1 SP from a 1st-job skill#. The SP that''s been reset may NOT be applied to 2nd or 3rd job skills.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49221, 1, 5050002, 'SP Reset (2nd job)', 'This scroll allows you to #creset 1 SP from a 2nd-level skill#. The 1st job SP raised AFTER the 2nd job adv. can also be reset and applied to a 2nd job skill. The SP that''s been reset may NOT be applied to 1st or 3rd job skills.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49222, 1, 5050003, 'SP Reset (3rd job)', 'This scroll allows you to #creset 1 SP from a 3rd-level skill#. The 1st & 2nd job SP raised AFTER the 3rd job adv. can also be reset and applied to a 3rd job skill. The SP that''s been reset may NOT be applied to 1st or 2nd job skills.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49223, 1, 5050004, 'SP Reset (4th job)', 'This scroll allows you to #creset 1 SP from a 4th-level skill#. The 1st, 2nd, and 3rd job SP raised AFTER the 4th job adv. can also be reset and applied to a 3rd job skill. The SP that''s been reset may NOT be applied to 1st, 2nd or 3rd job skills.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49224, 1, 5060000, 'Item Tag', 'This will enable the owner of the weapon to engrave his/her name on an equipment item once. Click on the item, and drag the item #con top of the equipment of choice# to engrave your character name on it.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49225, 1, 5060001, 'Item Guard', 'A lock that seals away any equipment items and throwing stars, excluding the quest items. By sealing the item away, the item will be #cdisabled from selling, trading, or throwing away#. Double-click on the lock to seal an item.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49226, 1, 5060002, 'Incubator', 'An equipment needed to open the #ceggs from pigme#.  Pigme eggs canve incubated by double clicking the incubator.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49227, 1, 5061000, 'Item Guard : 7 Days', 'A guard for sealing an equip item and/or throwing star to prevent #cselling, trading or dropping# of the item. Double-click on the guard, then seal the item into the window that appears. #cThis Item Guard is active for 7 days, after which the item will be automatically released from the seal.#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49228, 1, 5061001, 'Item Guard : 30 Days', 'A guard for sealing an equip item and/or throwing star to prevent #cselling, trading or dropping# of the item. Double-click on the guard, then seal the item into the window that appears. #cThis Item Guard is active for 30 days, after which the item will be automatically released from the seal.#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49229, 1, 5061002, 'Item Guard : 90 days', 'A guard for sealing an equip item and/or throwing star to prevent #cselling, trading or dropping# of the item. Double-click on the guard, then seal the item into the window that appears. #cThis Item Guard is active for 90 days, after which the item will be automatically released from the seal.#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49230, 1, 5070000, 'Cheap Megaphone', 'Shout to everyone in the map your character is on with this megaphone.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49231, 1, 5071000, 'Megaphone', 'Shout to everyone in the map your character is on with this megaphone. Only available for characters that are over Level 10.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49232, 1, 5072000, 'Super Megaphone', 'Shout to everyone in the world your character is on with this megaphone. Only available for characters that are over Level 10.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49233, 1, 5073000, 'Heart Megaphone', 'Shout to everyone in the world your character is on with this megaphone. (Heart accents)');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49234, 1, 5074000, 'Skull Megaphone', 'Shout to everyone in the world your character is on with this megaphone. (Red accent)');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49235, 1, 5075000, 'MapleTV Messenger', 'Show your avatar on Maple TV with messages. In case of dedication messages, character you have designated will also appear on the screen throughout the entire world.  The message will last appx. 15 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49236, 1, 5075001, 'MapleTV Star Messenger', 'Beautifully designed TV with star effects.  This allows you to type in longer messages with longer period of time, 30 seconds.  Only announcement type of message is available with this item.  The message will last for 30 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49237, 1, 5075002, 'MapleTV Heart Messenger', 'Beautifully designed TV with Heart effect. Propose in style on the TV.  This item only allows dedication type of message where designated user also appears on the TV.  The message will last for 1 minute.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49238, 1, 5075003, 'Megassenger', 'Show your message on the chatting window as well as Maple TV at the same time.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49239, 1, 5075004, 'Star Megassenger', 'Show your message on the chatting window as well as Maple TV at the same time.  This comes with star effect on the Maple TV.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49240, 1, 5075005, 'Heart Megassenger', 'Show your message on the chatting window as well as Maple TV at the same time.  This comes with heart effect on the Maple TV.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49241, 1, 5076000, 'Item Megaphone', 'Use this megaphone to broadcast to everyone your World about an item that may be for sale.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49242, 1, 5080000, 'Korean Kite', 'A kite that you can float around the skies at will. Enter your own message.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49243, 1, 5080001, 'Heart Balloon', 'A balloon full of love you can float around.  Enter your own message.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49244, 1, 5080002, 'Graduation Banner', 'A graduation banner you can float around. Enter your own message.');
