INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49278, 1, 5121017, 'Water Splash', 'You can enter the message of your choice.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49279, 1, 5122000, 'Hearty Party Bear', 'Everyone in the map receives Weapon Attack +30 and Magic Attack +30 for 15 minutes. You can enter a message of your choice, and special background music will be played while in use.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (49280, 1, 5130000, 'Safety Charm', 'It does not let the user lose EXP points after death, as long as it''s in possession. 30% of your HP and MP will be recovered when you are revived.');
