INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (50096, 1, 2022306, 'Primal Brew', 'A mixture made from an ancient Taru shaman recipe.  Instills warriors with the primal strength of the Jungle Spirit. [Gives +35 Weapon Attack, +10 Accuracy for 20 minutes.]');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (50097, 1, 2022307, 'Spirit Herbs', 'Special incense used by ancient Taru shamans for communion rituals with the Jungle Spirit. [Gives +90 Magic Attack for 20 minutes.]');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (50098, 1, 2022308, 'Jungle Juice', 'A delicious natural beverage made from a secret blend of jungle fruits, flowers, roots, and vines. The perfect thing to fuel a Taru brave through a long jungle trek!  [Restores 1000 HP and 2000 MP.]');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (50099, 1, 2022309, 'Treasure Hunt Note', 'Spread all over the Maple World for the 4th anniversary of MapleStory, this note contains the prizes that you''ll win when this is found.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (50100, 1, 2022310, 'Chocolate Cream Cupcake', 'A delicious chocolate cupcake with vanilla cream filling. One taste and you''ll be hooked!  [Restores 300 HP & MP, and gives +30 Accuracy, +30 Speed, and +30 Jump for 3 minutes.]');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (50101, 1, 2022311, 'Big Cream Puff', 'A rare, tasty dessert. Known as the ''Warrior''s Dessert'' to some and the ''Fattening Treat'' to others. [Gives +30 Weapon Attack for 3 minutes.]');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (50102, 1, 2022323, 'Fish Net with a Catch', 'The fish net seems to have caught something. Let''s double-click it to check its content.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (50103, 1, 2022324, 'Big Belly Fish', 'A fish that apparently swallowed something. Let''s double-click on the fish to check its content.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (50104, 1, 2022326, 'Blessing of the Forest', 'With the purified forest raining gold rain, all affected will receive a temporary boost on speed and jump.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (50105, 1, 2022332, 'Agent O''s Encouragement', 'An encouraging message from Agent O.  Jump rate will be increased by 20 for 30 minutes.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (50106, 1, 2022333, 'Agent O''s Encouragement', 'An encouraging message from Agent O.  Speed will be increased by 40 for 30 minutes.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (50107, 1, 2022335, 'Baby Chick Cookie', 'This is a cookie shaped like a baby chick. Recovers 1000 HP and MP.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (50108, 1, 2022336, 'Secret Box', 'Secret Box');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (50109, 1, 2022337, 'Sorcerer''s Potion', 'This is a potion that you can buy from Sorcerer. It''s potent, but its side-effects are equally strong. It''s also very expensive, so be careful with it.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (50110, 1, 2022338, 'VitroJuice', 'A futuristic power pack full of liquid fuel synthesized by T-1337.  Looks suspiciously like an energy drink.  Drink at your own risk! [Gives +14 Weapon Attack for 15 minutes]');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (50111, 1, 2022339, 'NitroJuice', 'A futuristic power pack full of liquid fuel synthesized by T-1337.  Looks suspiciously like an energy drink.  Drink at your own risk! [Gives +22 Weapon Attack for 10 minutes]');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (50112, 1, 2022340, 'BlastroJuice', 'A futuristic power pack full of liquid fuel synthesized by T-1337.  Looks suspiciously like an energy drink.  Drink at your own risk! [Gives +90 Weapon Attack for 1 minute]');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (50113, 1, 2022341, 'ElectroJuice', 'A futuristic power pack full of liquid fuel synthesized by T-1337.  Looks suspiciously like an energy drink, but drink at your own risk! [Gives +50 Magic Attack for 10 minutes.]');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (51443, 1, 2101202, 'GMEvent_Pink Bean', 'GMEvent_Pink Bean');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (50114, 1, 2022342, 'MegaJuice', 'A futuristic power pack full of liquid fuel synthesized by T-1337.  Looks suspiciously like an energy drink, but drink at your own risk! [Gives +200 Magic Attack for 30 seconds.]');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (50115, 1, 2022343, 'GigaJuice', 'A futuristic power pack full of liquid fuel synthesized by T-1337.  Tasty and strong enough to dissolve rust from machinery!  Drink at your own risk! [Gives +700 Magic Attack for 10 seconds.]');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (50116, 1, 2022344, 'JigaJuice', 'A futuristic power pack full of liquid fuel synthesized by T-1337.  Drink at your own risk!   Gives the user a sudden jolting surge of energy, so use it or lose it! [Gives +1000 Magic Attack for 5 seconds.]');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (50117, 1, 2022345, 'The Energizer Drink', 'An energizing drink packed with electrolytes. For 30 minutes, you will receive a boost of: Attack +25, Magic Attack +30, Defense +30');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (50118, 1, 2022352, 'Fire Grill Skewer', 'A delicious holiday food made out of beef, mushroom, and bellflower on a skewer.');
