INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (50333, 1, 2022637, 'Dragon''s Blessing', 'A blessing given by a GM that contains the power of a Dragon. Att +5, Magic +10, Weapon Defense +20, Magic Defense +20, and Speed +10 for 30 minutes.');
