INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (50335, 1, 2022652, 'Dragon Rider''s Warrior Box', 'A box dropped by the Dragon Rider. Contains a Warrior weapon. #cYou can open it by double-clicking on it.');
