INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (50340, 1, 2022657, 'Cheap Guitar Case', 'A Cheap Guitar Case. You can open it by double-clicking on it. If you don''t open it and let it expire, it will turn into an Expensive Guitar Case.');
