INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (50342, 1, 2022659, 'Legendary Guitar Case', 'A Legendary Guitar Case. You can open it by double-clicking on it. You should open it before it expires and disappears.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (50343, 1, 2022660, 'Dragon Rider Buff Zone Recovery Item', 'Recovers 400 HP and 200 MP.');
