INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (51481, 1, 2210000, 'Orange Mushroom Piece', 'A crystal piece that resembles Orange Mushroom. When used, the crystal will melt into the body, and its mythical power will transform the user into Orange Mushroom. This mythical power will last for an hour.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (51482, 1, 2210001, 'Ribbon Pig Piece', 'A crystal piece that resembles Ribbon Pig. When used, the crystal will melt into the body, and its mythical power will transform the user into Ribbon Pig. This mythical power will last for an hour.');
