INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (51484, 1, 2210003, 'Dragon Elixir', 'A mysterious elixir made by Moira which enables anyone that drinks this potion to temporarily transform into a dragon.');
