INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (51490, 1, 2210009, 'Sophillia''s Abandoned Doll', 'An abandoned doll that Sophillia threw away a long time ago, but revived by the Masked Man. Pet its hair, and you''ll turn into Sophillia for 3 minutes.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (51491, 1, 2210010, 'Potion of Transformation', 'The moment this potion is taken, you''ll become a powerful, otherworldly being.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (51492, 1, 2210011, 'Potion of Transformation', 'The moment this potion is taken, you''ll become a powerful, otherworldly being.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (51493, 1, 2210012, 'Change to Mouse', 'Transform into a small, tiny mouse.');
