INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (51495, 1, 2210017, 'Moon Photo', 'The more you look at it, the more you feel lightheaded… and you feel closer to the moon.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (51496, 1, 2210018, 'Sweet Rice Cake', 'A sweet, delicious rice cake. Sometimes creates an interesting set of powers.');
