INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (51498, 1, 2210022, 'Peto Transformation Potion', 'A transformation potion from the masked gentleman that allows you to transform into Peto for 15 minutes.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (51806, 1, 2381030, 'Meercat Card', 'A card that features Meercat.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (51499, 1, 2210023, 'Cliff''s Special Potion', 'No one knows what you''ll transform into when you drink this, but something WILL happen for one hour.  It''s all about the risk...');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (51500, 1, 2210024, 'Maplemas Party Potion', 'Double-click on this to transform a character of your choice. Which one? Try it and find out!');
