INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (60640, 1, 4001257, 'Staff of First Magic', 'A symbolic weapon of Mage mastery.  Although it can''t be equipped, its power is palpable.  This item must be placed in the Altar of Mastery to activate it.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (60641, 1, 4001258, 'Ancestral Bow', 'A symbolic weapon of Bowman mastery.  Although it can''t be equipped, its power is palpable.  This item must be placed in the Altar of Mastery to activate it.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (60642, 1, 4001259, 'Master Sword', 'A symbolic weapon of Warrior mastery.  Although it can''t be equipped, its power is palpable.  This item must be placed in the Altar of Mastery to activate it.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (60643, 1, 4001260, 'Forbidden Gun', 'A symbolic weapon of Pirate mastery.  Although it can''t be equipped, its power is palpable.  This item must be placed in the Altar of Mastery to activate it.');
