INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61886, 1, 4031693, 'Mute''s Model', 'A miniature model of Mute.  It was made for research purposes by the alchemists.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61887, 1, 4031694, 'Lumo''s Leaf', 'A rare leaf obtained from Lumo.  It contains the power of life but can easily die if mistreated.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61888, 1, 4031695, 'Snow Rose', 'A rose that is white like snow.  It was created by the alchemists.');
