INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61894, 1, 4031701, 'Chumji''s Watermelon', 'Sweet watermelon that is grown from Chumji''s field.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61895, 1, 4031702, 'Transparent Item', 'A transparent item that is used to fight off the watermelon keeper.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61896, 1, 4031703, 'Regular Tree Branch', 'A regular looking tree branch.  It doesn''t seem to have any special powers.');
