INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61898, 1, 4031705, 'Strange Bottle of Water', 'A water bottle containing transparent water.  It is tightly locked.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61899, 1, 4031706, 'Phyllia''s Letter', 'A letter Phyllia wrote to Erikson.  It seems to be about Kini''s condition.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61900, 1, 4031707, 'Ericsson''s Letter', 'A letter Ericsson wrote to Phyllia. It seems to be about the medicine for Keeny.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61901, 1, 4031708, 'Secret Document', 'A secretive document written with codes.  The bottom part is badly damaged and not readable.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61902, 1, 4031709, 'Lightless Magic Device', 'A magic device that has been completely used up.  There is no more use for it.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61903, 1, 4031710, 'Subway Ticket to NLC (Basic)', 'A basic ticket needed to get on the subway that goes from Kerning City to New Leaf City of Masteria Continent.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61904, 1, 4031711, 'Subway Ticket to NLC (Regular)', 'A Regular ticket needed to get on the subway that goes from Kerning City to New Leaf City of Masteria Continent.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61905, 1, 4031712, 'Subway Ticket to Kerning City (Basic)', 'A basic ticket needed to get on the subway that goes from New Leaf City to Kerning City of Victoria Island.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61906, 1, 4031713, 'Subway Ticket to Kerning City (Regular)', 'A Regular ticket needed to get on the subway that goes from New Leaf City to Kerning City of Victoria Island.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61907, 1, 4031731, 'Ticket to Singapore (From Kerning City)', 'A regular ticket needed to get on the plane that heads from Kerning City to Changi airport.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61908, 1, 4031732, 'Ticket to Kerning City (From CBD)', 'A regular ticket needed to get on the plane that heads from Changi airport to Kerning City.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61909, 1, 4031733, 'Ticket to Singapore (From Orbis)', 'A regular ticket needed to get on the plane that heads from Oribs to Changi airport.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61910, 1, 4031734, 'Ticket to Orbis (From CBD)', 'A regular ticket needed to get on the plane that heads from Changi airport to Orbis.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61911, 1, 4031737, 'Homunculus''s Blood', 'Blood that is made by Homunculus''s magic.  It has the power to reveal truth.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61912, 1, 4031738, 'Dran''s Medicine', 'Medicine that Dran made for his daughter Kini.  It seems rather ordinary but it is actually very difficult to make.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61913, 1, 4031739, 'Magic Stone of Humility', 'An orange magic stone that signifies humility. What kind of powers does this item have?');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61914, 1, 4031740, 'Magic Stone of Honesty', 'A green magic stone that signifies honesty. What kind of powers does this item have?');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61915, 1, 4031741, 'Magic Stone of Trust', 'A blue magic stone that signifies trust. What kind of powers does this item have?');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61916, 1, 4031743, 'Unknown Medicine', 'A medicine carried by Humanoid A. There''s no way to tell what kind of effect it has when consumed.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61917, 1, 4031744, 'Silver Pendant', 'A pendant with a rose engraving.  It seems to be missing its chain.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61918, 1, 4031745, 'Parwen''s Entry Pass', 'Entry pass that was used by Parwen.  It looks like any other entry passes but has a different number on it.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61919, 1, 4031750, 'Dark Matter', 'Strange matter from the depths of space.  When used in the construction of items, who knows what effect it''ll have!');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61920, 1, 4031751, 'Vorticular Gyro', 'A futuristic machine part that perpetually makes whirling noises.  Once a part of a bigger machine, it can be used to create something new.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61921, 1, 4031752, 'Blinking Dingbat', 'A futuristic machine part that blinks steadily and mysteriously.  It''s original use is unknown but it can be broken down to create something else.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61922, 1, 4031753, 'Zeta Residue', 'Residual matter from the explosion of a distant dying star that''s taken eons to reach here.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61923, 1, 4031754, 'Black Versal Materia', 'A form of concentrated energy, harvested from the alternate dimension of Versal. The dark energy denotes a chaotic element.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61924, 1, 4031755, 'Taru Totem', 'An ancient totem that pulses with mystic energy.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61925, 1, 4031756, 'Mystic Astrolabe', 'A golden instrument used for navigation.  Said to have magical effects when combined with other items.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61926, 1, 4031757, 'Antellion Relic', 'An old world tablet with strange markings. These are said to combine with other objects.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61927, 1, 4031758, 'Naricain Jewel', 'A lost jewel created by Naricain, the demon sorceror. Said to add tremendous dark power to crafted items.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61928, 1, 4031759, 'Subani Ankh', 'One of Subani''s Ankhs. Said to have protective powers and ward off darkness.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61929, 1, 4031760, 'White Versal Materia', 'A form of concentrated energy, harvested from the alternate dimension of Versal. The blinding white energy indicates it is still unstable.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61930, 1, 4031761, 'Materia Orb', 'Materia from Versal that has been stabilized into an orb form.  It still pulses with energy.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61931, 1, 4031762, 'Relic Weapon Blueprint', 'Relic Weapon Blueprint');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61932, 1, 4031763, 'Materia Weapon Blueprint', 'Materia Weapon Blueprint');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61933, 1, 4031764, 'Paranormal Activity Report Page', 'A page from a file detailing strange activity and possible locations for ghosts.  It doesn''t look very professional.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61934, 1, 4031765, 'Blank Paranormal Subject Questionnaire', 'This is an official MBI form that is intended for gathering data on paranormal subjects.  It is currently blank.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61935, 1, 4031766, 'Completed Paranormal Subject Questionnaire', 'This official MBI form has been completed by a paranormal subject.  Hmmm... very interesting information.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61936, 1, 4031767, 'Sophilia''s First Doll', 'A worn, happy looking doll that has seen better days.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61937, 1, 4031769, 'Tarrymore Earring', 'This beautiful, elegant earring belongs to Ludmilla.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61938, 1, 4031770, 'Sepha Earring', 'This expensive, stylish earring belongs to Ludmilla.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61939, 1, 4031771, 'Omni Key', 'A strange key kept in excellent condition. Can be used to enter fireplaces in the Prendergast Mansion.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61940, 1, 4031772, 'Toy Workshop Key', 'Jonas''s key to his Toy Workshop at the top of the Prendergast Mansion.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61941, 1, 4031773, 'Dry Branch', 'An arid branch so devoid of water, it looks like even the slightest touch might break it.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61942, 1, 4031774, 'Yulete''s Lab Report', 'A compilation of Yulete''s lab work and research. Very neat!');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61943, 1, 4031775, 'Frankenroid''s Blueprint', 'A blueprint of Frankenroid created by Yulete.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61944, 1, 4031776, 'Sirin''s Pattern', 'The pattern of the clothes Sirin designed. Comes with a detailed step-by-step guide for beginners.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61945, 1, 4031777, 'Juliet''s Present', 'Juliet made this for Romeo. What kind of guy would enjoy this as a gift?');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (61946, 1, 4031778, 'Romeo''s Love Letter', 'A letter Romeo wrote to profess his love for Juliet.');
