INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62924, 1, 4000554, 'Maverick Type A Component', 'A component of Maverick Type A that is abrasion-resistant due to its ergonomic design.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62925, 1, 4000555, 'Maverick Type S Laser Gun', 'A high-tech laser gun that consumes minimal energy yet ejects maximum power.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62926, 1, 4000556, 'Maverick Type D Booster', 'A booster that provides a temporary increase in thrust for flight.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62927, 1, 4000557, 'Imperial Guard Vacuum Tube', 'A vacuum tube that uses air pressure to maintain an output of at least 5 tons.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62928, 1, 4000558, 'Royal Guard Armor', 'Special armor that features a special alloy for maximum durability.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62929, 1, 4001333, 'Pot', 'A small pot with a flower bud in it. Watch it for 30 minutes to see a flower bloom.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62930, 1, 4001334, 'Yellow Flower Pot', 'A small pot that contains a yellow flower. Take it to Gaga to trade it for a crayon.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62931, 1, 4001339, 'Treacherous Fox Tail', 'The tail of a Treacherous Fox. It seems pretty useless, especially since it is covered in coarse fur.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62932, 1, 4001393, 'Time Traveler''s Pocket Watch', 'An object that signifies authorized use of the Time Gate in Tera Forest. It looks like an average pocket watch but has something engraved on the back. It reads, ''Time is Golden.''');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62933, 1, 4001394, 'Time Traveler''s Free Pass', 'An object that signifies authorized use of the Time Gate in Tera Forest for a limited time.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62934, 1, 4032430, 'Photo of the Moon', 'A photo of the moon that hasn''t developed yet. The image should become more vivid in 30 minutes. The photo will disappear if you log out!');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62935, 1, 4032431, 'Photo of the Moon', 'A faint photo of the moon that hasn''t been fully developed yet. The image should become more vivid in 30 minutes. The photo will disappear if you log out!');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62936, 1, 4032432, 'Photo of the Moon', 'A blurry photo of the moon that hasn''t been fully developed yet. The image should become more vivid in 30 minutes. The photo will disappear if you log out!');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62937, 1, 4032433, 'Photo of the Moon', 'A clear photo of the moon. This will certainly make the Baby Moon Bunny happy.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62938, 1, 4032434, 'Yellow Butterfly', 'A cute little yellow butterfly. It might fly away if you don''t keep your eye on it.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62939, 1, 4032447, 'Dog Food', 'A small bag of dog food. Bulldogs go crazy for this stuff.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62940, 1, 4032448, 'Lunch Made with Love', 'A special lunch Anna made for Gustav. It''s packed with tender loving care.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62941, 1, 4032449, 'Piglet', 'A piglet that escaped from the farm. Return it to the farm.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62942, 1, 4032450, 'Empty Lunch Box', 'Someone has devoured everything that was inside the lunch box.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62943, 1, 4032451, 'Egg', 'Eggs from the hen house in the back yard.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62944, 1, 4032452, 'Bundle of Hay', 'A bundle of hay used to feed livestock. Baby dragons might like it too.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62945, 1, 4032453, 'Pork', 'Juicy pork. Baby dragons might like it.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62946, 1, 4032454, 'Milk for Baby Dragon', 'Cow milk. Baby dragons might like it.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62947, 1, 4032455, 'Letter from Gustav', 'A letter Gustav wrote to Chief Stan in Henesys. The letter mentions something about pork delivery.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62948, 1, 4032456, 'Recommendation Letter - Chief Stan', 'A recommendation letter from Stan. Take it to Power B. Fore and he might let you use the training center.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62949, 1, 4032457, 'Power B. Fore''s Certificate of Training', 'A certificate that states the recipient has completed Power B. Fore''s training. It also appears to be a free pass to use Power B. Fore''s training center.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62950, 1, 4032458, 'Rina''s Blue Mushroom Porridge', 'Some Blue Mushroom porridge Rina made. It''s packed nicely and ready for delivery.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62951, 1, 4032459, 'Blue Mushroom Doll', 'A cute doll that resembles a Blue Mushroom.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62952, 1, 4032460, 'Refreshing Stump Sap', 'Tree sap from a Stump. It is surprisingly refreshing.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62953, 1, 4032461, 'Zombie Mushroom Doll', 'A doll that resembles a Zombie Mushroom, though something isn''t quite right with the face.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62954, 1, 4032462, 'Wild Boar Doll', 'A cute doll that resembles a Wild Boar.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62955, 1, 4032463, 'Document with Clue', 'A document that has a clue about the thief that stole Sabitrama''s herb written on it. It looks like an ordinary letter, though.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62956, 1, 4032464, 'Sabitrama''s Herb', 'A pouch with a pleasant herbal scent that obviously contains Sabitrama''s herb.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62957, 1, 4032465, 'Nella''s Letter of Introduction', 'A letter of introduction from Nella. It states that the recipient is a capable adventurer.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62958, 1, 4032466, 'Golem Doll', 'A cute doll that resembles a Golem.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62959, 1, 4032467, 'Dragon Scales', 'A few scales from dragon.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62960, 1, 4032468, 'Rapid Growth Accelerant', 'A rapid growth accelerant that was created by a secret organization. It appears to accelerate the growth of plants.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62961, 1, 4032469, 'John''s Map', 'John''s map, which contains information about some island. That island is said to be the place where the dragon lies asleep.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62962, 1, 4032470, 'Tropical Fruit Punch', 'Specially ordered tropical fruit punch that can only be made in Florina Beach.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62963, 1, 4032471, 'Black Key', 'A key you received from Shammos on a mission for a secret organization. What is this key used for?');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62964, 1, 4032472, 'Map of Turtle Island', 'The map of Turtle Island you received from Captain Hwang. It has the location of an island but not much else is known.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62965, 1, 4032473, 'Gruesome Bone', 'Bone that exudes a gruesome energy.');
