INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62969, 1, 4032477, 'Unbreakable Porcelain', 'Unbreakable Porcelain that Herb Town is known for.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62970, 1, 4032497, 'Potter', 'A master craftsman in Herb Town. He is as light as a feather.');
