INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62993, 1, 4160041, 'Pet Command Guide : Gold Pig', 'A guide that has all the commands for the Gold Pig. #cDouble-click on the item to open the guide.#');
