INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62995, 1, 4310000, 'Perfect Pitch', 'This Music Note gives Inkwell the perfect pitch he''s been dying to find. You can trade it for a rare item if you go to the Free Market Entrance or talk to Inkwell in Henesys before March 30th.');
