INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (62999, 1, 4032528, '크리스마스 요정', '선물을 포장하다가 상자 안으로 빨려들어가 버린 크리스마스 요정이다. 산타 클리프가 애타게 찾고 있으니, 행복한 마을에 있는 클리프에게 데려다 주자.');
