INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63033, 1, 4310007, 'Icy Guitar Pick', 'An icy blue pick used for playing the guitar. You can take it to Inkwell to purchase a special item.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63034, 1, 4320000, 'Damage Meter', 'A meter that can measure damage.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63035, 1, 4001453, 'Primrose Seed', 'A seed that will grow into a Primrose.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63036, 1, 4001454, 'Platform Puppet', 'A doll that steps on the Platform for people. It should be useful for Party Quests.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63037, 1, 4001455, 'Lord Pirate Hat Fragment', 'A fragment from the ripped hat of Lord Pirate.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63038, 1, 4032797, 'Robot Manual', 'A machine that has a robot''s blueprint drawn on it. You cannot view it if you do not know how to activate it.');
