INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63040, 1, 4032799, 'Robot Manual', 'A machine that has a robot''s blueprint drawn on it. You cannot view it if you do not know how to activate it.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63041, 1, 4032801, 'Fairy Research Report', 'A fairy research report written by Betty. It is written with complex wording, and you cannot understand it.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63042, 1, 4032802, 'Orange Brick', 'An orange brick made by JM from Mud Clumps. Take it to the Dark Lord.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63043, 1, 4032803, 'Gold Richie''s Box', 'Gold Richie''s delivery box that has a diamond Emblem engraved on it, and is wrapped with golden tape. The insides are unknown, since it is so tightly sealed. #Disappears if you log out.#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63044, 1, 4032804, 'Megran''s Pomegranate Seed', 'A red fruit from Megran. Unlike its sweet appearance, it is very bitter and is used as a rare medicine ingredient.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63045, 1, 4032805, 'Stumpy''s Old Ribbon', 'A red ribbon worn by Stumpy. It is old and worn out.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63046, 1, 4032806, 'Dyle Skin', 'A green alligator leather from Dyle. Unlike other alligator leather, it is very big.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63047, 1, 4032807, 'Faust''s Tail', 'A long black tail from Faust.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63048, 1, 4032808, 'Giant King Clang Claw', 'A claw from King Clang. It is sharp and bumpy.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63049, 1, 4032809, 'Nine-Tailed Fox Necklace', 'A necklace from the Nine-Tailed Fox. It is decorated with a very fine jade.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63050, 1, 4032810, 'Zeno''s Gloves', 'Gloves that were worn by Zeno. They''re made from unknown material that is very light, yet strong.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63051, 1, 4032811, 'Monster Purple Crystal', 'A purple crystal from a monster. It is used as one of Gaga''s research materials.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63052, 1, 4032812, 'Gold Richie''s Ignition Key', 'An ignition key that will test Gold Richie''s special weapon. It is painted in gold, and Gold Richie''s diamond emblem is engraved on it.');
