INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63061, 1, 4001435, 'Evan Sweat Droplet', 'The sweat drops of Evan. An item required for the #cEvan Trailblazer event.#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63062, 1, 4032639, 'Twin Dragon''s Egg', 'A solid-looking dragon egg that apparently holds legendary treasures, according to the Shadow Knight Rene. It can only be opened using the Twin Dragon''s Egg Incubator.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63063, 1, 4310003, '5th Anniversary Insignia', 'A one of a kind, untradeable item received by a player for taking over a town during a Cake or Pie invasion or from #cNPC Pie Lord Tiara or Cake Boss Daniel# after participating in a Cake or Pie invasion.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63064, 1, 4032658, 'Cake Piece', 'A non-consumable piece of anniversary cake dropped by all mobs and anniversary cake mobs. These items will continually drop throughout the event. Since after 3 hours the town returns to a neutral state, this allows players to strategize their attacks. Town Cake Piece turn in total will be at zero at event start and will also return to zero 3 hours after an invasion, when the town returns to neutral state.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63065, 1, 4032659, 'Pie Piece', 'A non-consumable piece of anniversary pie dropped by all mobs and anniversary pie mobs. These items will continually drop throughout the event. Since after 3 hours the town returns to a neutral state, this allows players to strategize their attacks. Town Pie Piece turn in total will be at zero at event start and will also return to zero 3 hours after an invasion, when the town returns to neutral state.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63066, 1, 4160047, 'Pet Command Guide : Mir/Ruby', 'A guide that has all the commands for the pet Mir/Ruby #cDouble-click on the item to open the guide.#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63067, 1, 4032698, 'Proof of Victory (Henesys)', 'This proves you won a Cake vs. Pie battle. Keep this item in your Inventory to get a 20% discount in certain shops and a 50% EXP boosts in nearby maps. This item disappears when your team no longer has control of the town.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63068, 1, 4032699, 'Proof of Victory (Orbis)', 'This proves you won a Cake vs. Pie battle. Keep this item in your Inventory to get a 20% discount in certain shops and a 50% EXP boosts in nearby maps. This item disappears when your team no longer has control of the town.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63069, 1, 4032700, 'Proof of Victory (Leafre)', 'This proves you won a Cake vs. Pie battle. Keep this item in your Inventory to get a 20% discount in certain shops and a 50% EXP boosts in nearby maps. This item disappears when your team no longer has control of the town.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63070, 1, 4032701, 'Proof of Victory (Magatia)', 'This proves you won a Cake vs. Pie battle. Keep this item in your Inventory to get a 20% discount in certain shops and a 50% EXP boosts in nearby maps. This item disappears when your team no longer has control of the town.');
