INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63085, 1, 4001208, 'Manji Coin', 'A commemorative coin with Manji engraved on it. Take it over to the merchants in town and trade it in for a good price.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63086, 1, 4001209, 'Wonky Coin', 'A commemorative coin with Wonky engraved on it. Take it over to the merchants in town and trade it in for a good price.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63087, 1, 4001210, 'Cassandra Coin', 'A commemorative coin with Cassandra engraved on it. Take it over to the merchants in town and trade it in for a good price.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63088, 1, 4001211, 'Gaga Coin', 'A commemorative coin with Gaga engraved on it. Take it over to the merchants in town and trade it in for a good price.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63089, 1, 4001212, 'Inkwell Coin', 'A commemorative coin with Inkwell engraved on it. Take it over to the merchants in town and trade it in for a good price.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63090, 1, 4001431, 'Golden Ticket', 'A one-time entry ticket to the Golden Temple Mini Dungeon. You can use it to enter the Monkey Temple or the Goblin Dungeon in the Golden Temple. The Golden Ticket will disappear upon entry.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63091, 1, 4001432, 'Premium Golden Ticket', 'An entry ticket to the Golden Temple Mini Dungeon. You can use it to enter the Monkey Temple and the Goblin Dungeon as frequently as desired for 1 hour.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63092, 1, 4001433, 'Sunburst', 'Flames from the sun that have divine powers to brighten darkness.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63093, 1, 4032558, 'Red Thermals', 'A red undergarment that Mrs. Ming Ming made for the townspeople. Wearing the thermals will bring much warmth.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63094, 1, 4032559, 'Air-Light Fluff', 'Fluff that might be even lighter than air. It''s mostly used to craft winter clothes for fairies. It''s so light that it floats around and is often caught high on tree branches.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63095, 1, 4032560, 'Burning Firewood', 'Firewood that is still burning. It can often be found inside Dark Axe Stumps that have been hit by lightning.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63096, 1, 4032561, 'Heat Pack', 'An item that warms up your cold hands and feet during winter. Rubbing the pack will trigger a heat reaction.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63097, 1, 4032562, 'Flaming Lava', 'Boiling lava that is extremely hot and dangerous. You can cool it down by taking it over to the Rock Covered in Snow.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63098, 1, 4032563, 'Fire Flower', 'A rare plant found in the Ant Tunnel. It exudes heat from its petals and does not freeze even during the harshest of winters.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63099, 1, 4032564, 'Red Tea Bag', 'A small tea bag full of red tea leaves. Steep it in hot water to enjoy the wonderful flavor of red tea.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63100, 1, 4032565, 'Tepid Lava', 'Lava that has been air-cooled to the perfect temperature. It has just the right amount of heat to warm up your room.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63101, 1, 4032566, 'Felt Piece', 'A thick piece of matted wool. It is widely used to make all sorts of items with its texture and various colors.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63102, 1, 4032567, 'Jumper Inner Layer', 'The base layer of a military jumper that provides an excellent thermal effect.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63103, 1, 4032568, 'Quilting Cotton', 'Cotton that is woven in squares in between two pieces of fabric.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63104, 1, 4032569, 'Warm Bubble', 'Bubble from the submarine volcano that contains warm air.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63105, 1, 4032570, 'Hot Stone', 'Mysterious stone found in Minar Forest that exudes heat.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63106, 1, 4032571, 'Temperature Secret', 'A scroll containing a secret method on how to exude body heat to survive the cold.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63107, 1, 4032572, 'Yellow Bellflower Bud', 'A rare bellflower bud that can be consumed after boiling or as a pill to enhance your health and resistance against the cold.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63108, 1, 4032573, 'Fire Sand', 'Red sand found in the desert of Ariant. It is the main ingredient of the Heat Pack, as it triggers a heat reaction when rubbed against a surface.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63109, 1, 4032574, 'Cast Iron', 'An extremely solid piece of iron that does not cool down quickly. It is used to build a heating apparatus.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63110, 1, 4032575, '1 Degree', 'A degree of warm temperature.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63111, 1, 4032602, 'Ritaya''s Cell Phone', 'Cell phone that belongs to a young lady who came to visit the Golden Temple.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63112, 1, 4032603, 'Ritaya''s Camera', 'Camera that belongs to a young lady who came to visit the Golden Temple.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63113, 1, 4032604, 'Fresh Lime', 'Lime that belongs to Toniza who sells fruits in the Golden Temple.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63114, 1, 4032605, 'Golden Ticket Piece', 'A piece of the Golden Ticket that has been torn after use. Collect 10 pieces and take it over to Mr. Yoo, the PR manager, and he will give you a Golden Ticket.');
