INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63127, 1, 4220154, 'Warm Thermometer', 'A thermometer that displays a person''s heart. \r #cDouble-click to check the temperature.#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63128, 1, 4220178, 'Energy Cartridge', 'An energy cartridge from an Android. Energy must be charged with EXP.');
