INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63130, 1, 4160025, 'Pet Command Guide : White Monkey', 'A guide that has all the commands for the White Monkey. #cDouble-click on the item to open the guide.#');
