INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63148, 1, 4001450, 'Black Mage''s Henchman Emblem', 'An emblem of Black Mage''s Henchmen. It can only be identified by evil eyes.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63149, 1, 4032615, 'Ryden''s Seal', 'A seal from Ryden. It must be delivered to Shiba.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63150, 1, 4032616, 'Mirror of Insight', 'A legendary item that can supposedly grant you the power of insight. Take it over to Lady Syl.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63151, 1, 4032617, 'Former Dark Lord''s Diary', 'A diary that was left by Lady Syl''s father, also known as the Former Dark Lord. It contains his life stories, but it is hard to decipher because it is written in codes.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63152, 1, 4032618, 'King Sage Cat Calabash', 'A calabash in which the King Sage Cat is sealed. It must be delivered to Arec in El Nath.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63153, 1, 4032619, 'Letter to Lady Syl', 'A letter to Lady Syl from Arec. It''s better to not open the letter because of its confidentiality.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63154, 1, 4032620, 'Secret Map', 'A map piece which a place in Perion has been marked. Collect 20 pieces to see the complete map.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63155, 1, 4032621, 'Bubbling''s Dual Blade Seal', 'A Dual Blade seal that was installed in a Bubbling.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63156, 1, 4032622, 'Octopus''s Dual Blade Seal', 'A Dual Blade seal that was installed in an Octopus.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63157, 1, 4032623, 'Stirge''s Dual Blade Seal', 'A Dual Blade seal that was installed in a Stirge.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63158, 1, 4032624, 'Dark Stump''s Dual Blade Seal', 'A Dual Blade seal that was installed in a Dark Stump.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63159, 1, 4032629, 'Single Stem Tulip', 'A yellow tulip stem that the Fire Boar cherishes. Collect 20 and deliver them to Yun.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63160, 1, 4032630, 'Secret Report', 'A document that is known to contain top secret information about Maple World. Cassandra seems interested in this report.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63161, 1, 4032640, 'Truth Lollipop', 'Warning: Telling lies while consuming this lollipop will induce severe sneezing. Recommendation: No more than 10 per day. Excessive consumption may result in cavities.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63162, 1, 4032641, 'Blue Chocolate Chip Cookie', 'A blue chocolate chip cookie mainly used in pranks. Cookie consumption will result not only in blue lips, but also in a blue face. It can be obtained from blue or purple monsters.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63163, 1, 4032665, 'Nix''s Magic Pill', 'A magic pill that was created by Nix the Wise of Minar Forest. It looks strangely modern, and it supposedly has the power to change your looks to their ideal state.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63164, 1, 4032667, 'Blue Scale', 'A blue scale of Blueon, the captain of Blue Dragon Turtles. It symbolizes harmony and friendship amongst Blue Dragon Turtles.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63165, 1, 4032668, 'Red Scale', 'A red scale of Redring, the captain of Red Dragon Turtles. It symbolizes harmony and friendship amongst Red Dragon Turtles.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63166, 1, 4032669, 'Unofficial History Book of Magatia', 'An unofficial history book of Magatia that was purchased from Han the Broker. It is a forbidden book that contains the hidden history of Magatia.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63167, 1, 4032670, 'Scribbled Note', 'A note containing ambiguous scribbles. It seems to be a diagram with an explanation of a pentacle, but only an alchemist would be able to fully understand it.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63168, 1, 4032671, 'Fake Sand Bandit Emblem', 'A fake Sand Bandit emblem that Jano prepared. Most people would surely fall for it.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63169, 1, 4032672, 'Aged Bellflower Root', 'An extremely old root from an aged bellflower named Guon near Herb Town. It appears to have effects just as miraculous as those of ginseng.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63170, 1, 4032673, 'Mr. Do''s New Medicine', 'A new medicine that Mr. Do invented. People are not certain whether it is poisonous. Do NOT consume even when offered.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63171, 1, 4032674, 'Chumji''s Ragged Document', 'A document Chumji ripped up and threw away. You might be able to read what it says if you collect all the pieces and put them together.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63172, 1, 4032675, 'Hodori Claw', 'A sturdy claw made out of Hodori''s leather. It cannot be equipped.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63173, 1, 4032676, 'Hogul''s Uniform', 'The uniform Hogul was wearing. It cannot be equipped.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63174, 1, 4032677, 'Agent M''s Bow', 'A cute bow Agent M lost. Could Agent M have tried to wear it himself?');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63175, 1, 4032678, 'Korin''s Letter', 'A letter Korin wrote to Agent M. Being the stereotypical girl, Korin wrote on pink stationery.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63176, 1, 4032679, 'Sarah''s Gloves', 'Gloves that Sarah made. Judging from the white laces, the gloves appear to be made for weddings.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63177, 1, 4032680, 'Master Robo Model', 'A toy modeled after Master Robo. Kids would love it.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63307, 1, 4000583, 'Ferocious Hoblin Horn', 'The horn of a Ferocious Hoblin.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63178, 1, 4032681, 'Sarah''s Gloves', 'Gloves that Sarah made for Nana. They seem quite valuable.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63179, 1, 4032682, 'Agent M''s Present', 'A present to Korin from Agent M.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63180, 1, 4032683, 'Death Teddy''s Button', 'A button that has a lot of memories of Death Teddy and its master.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63181, 1, 4032684, 'Ducky Five', 'The fifth duck that Ducky lost. This one smells like trouble.');
