INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63536, 1, 3994090, 'Spices', 'Mr. Oh sells these rare spices at the Maple 7th Day Market. You can sell them to Abdula for a profit.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63537, 1, 3994091, 'Memorabilia from Thailand', 'You can find these memorabilia from Thailand at the Maple 7th Day Market. You can sell them to Abdula for a profit.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63538, 1, 3994092, 'Unagi', 'Lena sells delicious unagi at the Maple  7th Day Market. You can sell it to Abdula for a profit.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63539, 1, 3994093, 'Taxidermy Shark', 'This taxydermy shark, handmade by Tae Gong himself, can be found at the Maple 7th Day Market. You can sell it to Abdula for a profit.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63540, 1, 3994094, 'Crow-feather Hat', 'Hanako sells this exquisite at the Maple 7th Day Market. You can sell it to Abdula for a profit.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63541, 1, 3012005, 'Amorian Loveseat', 'A comfortable, stylish seat that only forms when true love exists between two people.  Recovers 45 HP, 45 MP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63542, 1, 3994089, 'Agent W''s Memory Chip', 'A memory chip Agent W left with me.  Information regarding ''Master M'' is said to be contained in it.  If I don''t enter the secret code every hour, it will self-destruct.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63543, 1, 3010046, 'Dragon Chair(Inferno)', 'Inferno will comfort your body. Recovers 60 HP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63544, 1, 3010047, 'Dragon Chair(Abyss)', 'Abyss will comfort your mind. Recovers 60 MP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63545, 1, 3010072, 'Miwok Chief''s Chair', 'The chair in which the chiefs of the Miwok tribe sat. If you sit in this chair, you can receive the strength of the Miwok ancestors and recover 65MP in 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63546, 1, 3994141, 'Cassandra''s Candle', 'A small candle given by Cassandra. This candle will turn off automatically when the game ends.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63547, 1, 3010058, 'WorldEnd', 'You will recover 50 HP every 10 seconds. Perhaps, as you recline, you will find the answer to many of life''s questions.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63548, 1, 3010057, 'BloodyRose', 'You will recover 50 HP every 10 seconds. You will experience the might of a conqueror after recovery.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63549, 1, 3010060, 'Noblesse Chair', 'A chair makes you feel like you''re sitting in the lap of luxury. Also recovers 50 HP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63550, 1, 3010061, 'Underneath the Maple Tree…', 'A white chair created to celebrate Maple Story''s 5th Anniversary. Sit on it to restore 35 HP and 10 MP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63551, 1, 3010062, 'Bamboo Chair', 'A chair that restores HP every 10 seconds when used. It''s very strong since it was made from bamboo grown on Rien.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63552, 1, 3010063, 'Moon and Star Cushion', 'A pretty cushion shaped like a moon. Recovers 60 HP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63553, 1, 3010064, 'Male Desert Rabbit Cushion', '60 HP is restored every 10 seconds if you lean back on this cute Male Desert Rabbit Cushion.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63554, 1, 3010065, 'Pink Beach Parasol', 'A pink beach chair that makes you want to go to the beach. Restores 60 HP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63555, 1, 3010066, 'Navy Velvet Sofa', 'A luxurious velvet sofa dyed with a beautiful shade of navy. Restores 60 HP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63556, 1, 3010067, 'Red Designer Chair', 'A designer chair that glows with a passionate red. Restores 60 HP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63557, 1, 3994101, 'Cassandra''s Giant Star', 'A Giant Star that Cassandra made for you. If you hold it during the Starlight Festival, you can receive 1 Star Stamp every hour.  #cDisappears when you log out of the game.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63558, 1, 3994102, 'Letter N for Compass', 'A Letter N that looks like it would fit perfectly on the Empty Compass.');
