INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63577, 1, 3010116, 'The Spirit of Rock Chair', 'A new chair that makes you feel like a Rock Star. Recovers 60 HP and 30 MP every 10 seconds.');
