INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63591, 1, 3994138, 'Ice Crystal', 'A solid ice crystal that contains Maha Charm. Hold onto it for one hour and the crystal will melt, enabling you to acquire the Charm.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63592, 1, 3994139, 'Maha Charm', 'A charm that contains protection from Maha, the spirit of Polearm. Take this to Cassandra for a chance to answer questions and receive prizes.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63593, 1, 3010101, 'Christmas Gift Box', 'A huge X-mas Gift Box big enough to fit a grownup. It has a message that reads, "I am here for you." Sitting in it will recover 50 HP and MP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63594, 1, 3010073, 'Giant Pink Bean Cushion', 'A cushion that resembles Pink Bean, the underling of the Black Mage. Leaning against the cushion and resting will recover 50 HP and 30 MP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63595, 1, 3010099, 'Cuddly Polar Bear', 'Cuddling with the Polar Bear for some cozy, comfy rest will recover 50 HP and 50 MP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63596, 1, 3010044, 'Winter Red Chair', 'A chair with a big umbrella. Recovers 30 HP and 30 MP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63597, 1, 3010106, 'Ryko Chair', 'Snuggle up with Aran''s loyal mount, Ryko, to recover 50 HP and MP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63598, 1, 3010111, 'Tiger Skin Chair', 'Lean back on this imposing Tiger Skin Chair to restore 50 HP and 30 MP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63599, 1, 3010080, 'Swing on the Persimmon Tree', 'There is a swing on the Persimmon Tree with ripe persimmons.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63600, 1, 3010081, '홍상모 월묘 방석', '방석에 앉으면 빨간 상모를 쓴 귀여운 월묘의 재주를 볼 수 있다.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63601, 1, 3010082, '청상모 월묘 방석', '방석에 앉으면 파란 상모를 쓴 귀여운 월묘의 재주를 볼 수 있다.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63602, 1, 3010083, '부채춤 월묘 방석', '방석에 앉으면 부채를 들고 줄타기를 하는 월묘의 재주를 볼 수 있다.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63603, 1, 3010084, '태평소 월묘 방석', '방석에 앉으면 혼신의 힘을 다해 연주하는 월묘를 볼 수 있다.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63604, 1, 3010092, 'Witch''s Broomstick', 'Hold onto the Broomstick so you don''t fall off.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63605, 1, 3012010, 'Half-Heart Chocolate Cake Chair', 'Sink yourself into this heavenly cake chair next to someone else who owns it as well, and watch it create a scrumptious effect! Mmm, this chair is so delicious you''ll recover 50 HP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63606, 1, 3012011, 'Chocolate Fondue Chair', 'Yummy! Use this chair next to someone else who''s also using it, and a mouth-watering chocolate fondue appears. Smack your lips and dream about treats as you recover 50 HP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63607, 1, 3010069, 'Yellow Robot Chair', 'Perch yourself on the hand of this powerful yellow robot to recover 50 HP and 30 MP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63608, 1, 3994179, '카산드라의 별상자', '카산드라의 PC방 왕별이 들어있는 상자다. 90분 동안 잘 가지고 있으면, 카산드라의 PC방 왕별로 변한다. 접속종료하면 사라져 버린다.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63609, 1, 3994180, '카산드라의 PC방 왕별', '카산드라가 찾고 있는 PC방 왕별이다. 접속종료하면 사라져버린다.');
