INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63616, 1, 3010107, 'Dragon Egg', 'Sit on this cracked dragon egg shell and relax to recover 40 HP and 20 MP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63617, 1, 3010108, 'Baby Swing', 'Sit on this baby dragon swing to recover 40 HP and 20 MP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63618, 1, 3994184, 'Cassandra''s Strange Potion', 'Hold onto this for 30 minutes and the cold weather will turn it into slush. It''s so delicate it will disappear if you log out.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63619, 1, 3994185, 'Cassandra''s Strange Slush', 'Give it to Cassandra before it disappears!');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63620, 1, 3994186, 'Mini Dragon Egg', 'A Mini Dragon Egg that Cassandra has left in your care. You must hold it close and keep it warm for one hour for it to hatch. Logging out will cause it to be destroyed.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63621, 1, 3994187, 'Mini Dragon', 'A Mini Dragon that hatched from the egg Cassandra left with you. Return it to Cassandra to receive a reward!');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63622, 1, 3010120, 'Easter Egg Basket', 'Sit on this Easter Egg Basket for a sweet thrill of happiness. Recovers 40 HP and 30 MP every 10 seconds while resting.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63623, 1, 3010126, 'Balrog Chair', 'A chair that resembles Balrog, an ancient demon that is rumored to be found deep inside Sleepywood Dungeon. When you sit in this menacing chair, 60 HP and 60 MP will be restored every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63624, 1, 3010127, 'Zakum Chair', 'A chair that resembles Zakum, a monster that is worshipped by residents near the volcanic area. When you sit in this chair, you''ll feel the power of Zakum. 80 HP and 50 MP will be restored every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63625, 1, 3010128, 'Horntail Chair', 'A chair that resembles Horntail, an evil three-headed dragon that lives in Leafre''s Dragon Forest. When you sit on a Horntail Chair, your injuries will heal quicker. 100 HP and 40 MP will be restored every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63626, 1, 3010109, 'Furnace Chair', 'Sit on this chair to feel the warmth from the furnace. You can recover 40 HP and 20 MP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63627, 1, 3010110, 'Polar Bear Chair', 'Snuggle up in this cozy polar bear chair to recover 40 HP and 20 MP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63628, 1, 3010113, 'Soul Teddy Chair', 'Sit on this Soul Teddy chair to recover 50 HP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63629, 1, 3010114, 'Lord Pirate Chair', 'Sit on this Lord Pirate chair to recover 50 HP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63630, 1, 3010115, 'Teddy Bear Bed', 'Relax in this cozy teddy bear bed to recover 50 HP and MP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63631, 1, 3010021, 'Wooden Tub', 'Enjoy a bath and relax in this spacious wooden tub to recover 40 HP and 20 MP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63632, 1, 3010049, 'Igloo', 'Stay in this igloo made out of ice and snow to recover 40 HP and 30 MP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63633, 1, 3010055, 'Mochi Ice Cream Chair', 'Relax in this mochi ice cream chair to recover 30 HP and MP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63634, 1, 3994188, 'Empty Compass', 'An empty compass that will eventually be used to make a Golden Compass.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63635, 1, 3010117, 'Magic Book Chair', 'Take a break by sitting on this floating chair to recover 50 HP and 30 MP every 10 seconds. #cCannot be traded or dropped.#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63636, 1, 3010095, 'Stone Golem Hand Chair', 'Take a break by leaning on the Stone Golem Hand to recover 50 HP and MP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63637, 1, 3010096, 'Dragon Skull Chair', 'Take a break by leaning on the Dragon Skull Chair to recover 50 HP and MP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63638, 1, 3010129, 'Chief Chair', 'A chair that symbolizes the authority of a chief. You can recover 50 HP and 50 MP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63639, 1, 3010130, 'Rose Chair', 'A chair with the romantic scent of roses. You can recover 50 HP and 50 MP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63640, 1, 3010131, 'Chewing Panda Chair', 'A chair with an adorable yet lazy panda chewing a bamboo stick. You can recover 50 HP and 50 MP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63641, 1, 3010132, 'Fuzzy Kitty Chair', 'A chair with a fuzzy kitty rubbing its face on its body. You can recover 50 HP and 50 MP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63642, 1, 3010133, 'Tent Chair', 'A chair that provides you the full wilderness experience. You can recover 50 HP and 50 MP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63643, 1, 3010134, 'Underneath the Maple Tree...', 'A white chair made to commemorate the beginning of MapleStory. You can recover 35 HP and 10 MP every 10 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (63644, 1, 3010154, 'Mechanical Chair', 'Mechanical chair that recovers HP every 10 seconds.');
