INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72740, 5, 1000, 'Three Snails', '[Master Level : 3] Hurls snail shells to attack monsters from long distance.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72741, 5, 1001, 'Recovery', '[Master Level : 3] Enables the user to recover HP constantly for 30 sec.  #cTerms between skills : 10 min.#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72742, 5, 1003, 'Legendary Spirit', '[Master Level : 1] Uses the spirit of a legend to use a scroll on an item that cannot be normally equipped by the character.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72743, 5, 1004, 'Monster Rider', '[Master Level : 1] Enables one to ride on a tamed monster and use it as a method of transportation.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72744, 5, 1002, 'Nimble Feet', '[Master Level : 3] Enables the character to move around quickly for a short amount of time.  #cTerms between skills : 1 min.#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72745, 5, 1013, 'Spaceship', '[Master Level : 2] You board a spaceship. While aboard, you can increase your movement and jump abilities by pressing the right/left direction key twice. #Available until: 06-08-2009 at 00 hour#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72746, 5, 1014, 'Space Dash', '[Master Level : 1] Increase your movement and jump abilities by pressing the right/left direction key twice. #cAvailable until 06-08-2009 at 00 hour#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72747, 5, 1015, 'Space Beam', '[Master Level : 1] Changes the condition of the Krypto found at the Space Mine. #cAvailable until: 06-08-2009 at 00 hour#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72748, 5, 1001003, 'Iron Body', 'Increases your Weapon Defense for a fixed amount of time.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72749, 5, 1001004, 'Power Strike', 'Consumes MP to deliver powerful damage to enemies.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72750, 5, 1001005, 'Slash Blast', 'Consumes MP to attack up to 6 nearby enemies simultaneously. Required Skill: #cPower Strike Lv. 1#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72751, 5, 1000006, 'HP Boost', 'Permanently increases Max HP.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72752, 5, 2001002, 'Magic Guard', 'Damage dealt to you affects your MP instead of your HP. If your MP reaches 0, your HP takes the full amount of damage.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72753, 5, 2001003, 'Magic Armor', 'Uses magic to temporarily increase Weapon DEF and Magic DEF.  Required Skill:  #cMagic Guard Lv. 3#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72754, 5, 2001004, 'Energy Bolt', 'Consumes MP to attack one enemy.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72755, 5, 2001005, 'Magic Claw', 'Attack up to 2 nearby enemies twice. Required Skill: #cEnergy Bolt Lv. 1#');
