INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72764, 5, 4001002, 'Disorder', 'Temporarily decreases an enemy’s Weapon Attack and Defense, eventually neutralizing the monster’s attack. Cannot be used on the same monster repeatedly.');
