INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72796, 5, 2201002, 'Teleport', 'Allows you to teleport a set distance to other locations on the same map using the arrow keys.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72797, 5, 2201003, 'Slow', 'Temporarily slows the movement of up to 6 monsters. Cannot be used on the same monsters more than twice in a row. Required Skill:  #cTeleport: Lv. 5#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72798, 5, 2201004, 'Cold Beam', 'Creates an ice fragment to attack and Freeze an enemy. Frozen enemies take extra damage from Fire Attribute attacks.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72799, 5, 2201005, 'Thunder Bolt', 'Creates a powerful magnetic field that fires down lightning bolts on up to 6 enemies.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72800, 5, 2200006, 'Spell Mastery', 'Increases Magic Mastery and Magic Attack.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72801, 5, 2300000, 'MP Eater', 'Absorbs the enemy MP when attacking with Magic skills until the enemy''s MP reaches 0. Required Skill: #cSpell Mastery Lv. 5#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72802, 5, 2301001, 'Teleport', 'Allows you to teleport a set distance to other locations on the same map using the arrow keys.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72803, 5, 2301002, 'Heal', 'Restores the HP of all nearby party members. Undead monsters in the area take damage from this skill.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72804, 5, 2301003, 'Invincible', 'Temporarily decreases weapon damage received. It has no effect on the magic attacks. Required Skill: #cHeal Lv. 5#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72805, 5, 2301004, 'Bless', 'Temporarily increases the Weapon Attack, Magic Attack, Defense, Accuracy, and Avoidability of all party members nearby. Required Skill: #cInvincible Lv. 5#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72806, 5, 2301005, 'Holy Arrow', 'Attacks a single monster by firing Holy Arrows.  Very effective against the Undead and Devil monsters.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72807, 5, 2300006, 'Spell Mastery', 'Increases Magic Mastery and Magic Attack.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72808, 5, 3100000, 'Bow Mastery', 'Increases the weapon mastery and accuracy of bows.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72809, 5, 3100001, 'Final Attack : Bow', 'Grants a chance to deal additional damage after an attack. Must have a bow equipped. Required Skill: #cBow Mastery Lv. 3#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72810, 5, 3101002, 'Bow Booster', 'Doubles the attack speed of your weapon. Must have a bow equipped. Required Skill: #cBow Mastery Lv. 5#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72811, 5, 3101003, 'Power Knock-Back', 'Deals damage to nearby enemies and knocks them back.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72812, 5, 3101004, 'Soul Arrow : Bow', 'Enables you to use your bow without consuming arrows for a fixed period of time. Required Skill: #cBow Booster Lv. 5#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72813, 5, 3101005, 'Arrow Bomb: Bow', 'Fires arrows with bombs attached to them to temporarily Stun your target and enemies near your target.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72814, 5, 3100006, 'Enhanced Basics', 'Enhances Arrow Blow and Double Shot.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72815, 5, 3200000, 'Crossbow Mastery', 'Increases the weapon mastery and accuracy of Crossbows.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72816, 5, 3200001, 'Final Attack : Crossbow', 'Grants a chance to deal additional damage after an attack. Must have a crossbow equipped. Required Skill: #cCrossbow Mastery Lv. 3#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72817, 5, 3201002, 'Crossbow Booster', 'Doubles the attack speed of your weapon. Must have a crossbow equipped. Required Skill: #cCrossbow Mastery Lv. 5#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72818, 5, 3201003, 'Power Knock-Back', 'Deals damage to nearby enemies and knocks them back.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72819, 5, 3201004, 'Soul Arrow : Crossbow', 'Allows you to use your crossbow without consuming ammo for a fixed period of time. Required Skill: #cCrossbow Booster Lv. 5#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72820, 5, 3201005, 'Iron Arrow : Crossbow', 'Fires a steel arrow that can penetrate a crowd of enemies. Attacks up to 6 enemies, but the damage is split between the enemies.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72821, 5, 3200006, 'Enhanced Basics', 'Enhances Arrow Blow and Double Shot.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72822, 5, 4100000, 'Claw Mastery', 'Increases the weapon mastery and accuracy of Throwing Stars, and enhances the max number of charges.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72823, 5, 4100001, 'Critical Throw', 'Enhances Critical Attack Rate and Minimum Critical Damage. Required Skill: #cClaw Mastery Lv. 3#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72824, 5, 4101003, 'Claw Booster', 'Doubles the attack speed of your weapon. Must have a Claw equipped. Required Skill: #cClaw Mastery Lv. 5#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72825, 5, 4101004, 'Haste', 'Temporarily boosts the Speed and Jump of the entire party.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72826, 5, 4101005, 'Drain', 'Absorb some of the damage dished out to the enemy as HP. You cannot absorb more than half of your Max HP or more than the enemy''s Max HP.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72827, 5, 4100006, 'Shadow Resistance', 'With the help of the Darkness, Max HP, Abnormal Status Resistance, and Elemental Resistance are permanently increased.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72828, 5, 4200000, 'Dagger Mastery', 'Increases the weapon mastery and accuracy of daggers.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72829, 5, 4201002, 'Dagger Booster', 'Doubles the attack speed of your weapon. Must have a dagger equipped. Required Skill: #cDagger Mastery Lv. 5#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72830, 5, 4201003, 'Haste', 'Temporarily boosts the Speed and Jump of the entire party.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72831, 5, 4201004, 'Steal', 'Quickly attacks multiple enemies, with a chance to steal enemy items. Only works once per monster. You can keep trying until you succeed. Required Skill: #cHaste Lv. 5#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72832, 5, 4201005, 'Savage Blow', 'Deals very quick consecutive attacks to a monster.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72833, 5, 4200006, 'Shadow Resistance', 'With the help of the Darkness, Max HP, Abnormal Status Resistance, and Elemental Resistance are permanently increased.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72834, 5, 1110000, 'Improving MP Recovery', 'Restores some MP every 4 seconds, even in combat.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72835, 5, 1111002, 'Combo Attack', 'For a fixed amount of time, accumulates combo orbs with each attack. Allows you to charge 5 combo orbs max. Each combo orb increases the damage you deal.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72836, 5, 1111003, 'Panic', 'Deals damage to one monster, with a chance to cast Darkness it. Can only be used when at least one combo orb is charged. More combo orbs equals more damage.  Required Skill: #cCombo Attack Lv. 1#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72837, 5, 1111005, 'Coma', 'Powerfully strikes a group of monsters, with a chance to Stun them. Can only be used when at least one combo orb is charged. More combo orbs equals more damage. Required Skill: #cCombo Attack Lv. 1#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72838, 5, 1111007, 'Magic Crash', 'Has a chance to cancel all enemy buffs and prevent them for casting new buffs. [Cooldown: 1 min]\Required Skill: #cShout Lv. 3#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72839, 5, 1111008, 'Shout', 'Shouts at enemies, dealing damage and possibly Stunning them.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72840, 5, 1110009, 'Chance Attack', 'Deals greater damage when attacking enemies that are stunned, blinded, or frozen.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72841, 5, 1111010, 'Brandish', 'Perform a double attack on enemies in front of you.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72842, 5, 1210001, 'Shield Mastery', 'Increases Weapon Defense and Magic Defense when a shield is equipped.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72843, 5, 1211002, 'Charged Blow', 'Uses the element attribute applied to a weapon to attack multiple enemies simultaneously. Can only be used when charged and has a chance to Stun enemies. Using Charged Blow does not deactivate the skill.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72844, 5, 1211004, 'Fire Charge', 'Temporarily charges your weapon with the Fire Attribute, increasing its attack. It will become uncharged when its duration wears off or when Charged Blow is used.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72845, 5, 1211006, 'Ice Charge', 'Temporarily charges your weapon with the Ice Attribute, increasing its attack. It will become uncharged when its duration wears off or when Charged Blow is used.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72846, 5, 1211008, 'Lightning Charge', 'Temporarily charges your weapon with the Lightning Attribute, increasing its attack. Can be combined with other attribute charge skills. It will become uncharged when its duration wears off or when Charged Blow is used.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72847, 5, 1211009, 'Magic Crash', 'Has a chance to cancel all enemy buffs and prevent them for casting new buffs. [Cooldown: 1 min]\Required Skill: #cCharge Blow Lv. 3#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72848, 5, 1211010, 'HP Recovery', 'Instantly restores some of your HP.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72849, 5, 1211011, 'Combat Orders', 'Temporarily grants bonus skill level to the skills of all party members, including yourself. #cSkills that have already reached the master level can surpass the master level.#  Exceptions: Beginner skills and Combat Orders cannot be increased.  Required Skill: #cHP Recovery Lv. 5#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72850, 5, 1310000, 'Elemental Resistance', 'Increases your resistance to Elemental Attacks.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72851, 5, 1311001, 'Dragon Buster', 'Stabs an enemy in front of you multiple times.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72852, 5, 1311003, 'Dragon Fury', 'Enables you to swing your weapon around in a large radius to attack nearby enemies. Up to 6 enemies can be attacked.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72853, 5, 1311005, 'Sacrifice', 'Uses the hidden power of a dragon to deal an attack to one enemy that ignore an enemy''s Defense by sacrificing your own HP. Does not ignore the DEF of bosses. Can only be used when your HP is 20% or above.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72854, 5, 1311006, 'Dragon Roar', 'Attacks up to 15 monsters at once by temporarily stunning them.  Only works when you have over 50% HP. Required Skill: #cSacrifice Lv. 3#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72855, 5, 1311007, 'Magic Crash', 'Has a chance to cancel all enemy buffs and prevent them for casting new buffs. [Cooldown: 1 min]\Required Skill: #cDragon Blood Lv. 3#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72856, 5, 1311008, 'Dragon Blood', 'Increases Weapon Attack for a fixed period of time while consuming HP. This skill is canceled when you don''t have enough HP to be consumed in the next 4 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72857, 5, 1310009, 'Dragon Wisdom', 'Increases Critical Rate and minimum Critical Damage when using a dragon skill. Has a chance to convert a portion of damage to HP for up to half of your HP. [Dragon Skills: Dragon Roar, Dragon Fury, Dragon Buster, Sacrifice]');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72858, 5, 2110000, 'Partial Resistance', 'Increase Poison and Fire Resistance.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72859, 5, 2110001, 'Element Amplification', 'Increases the MP cost and the Magic Attack of your magic skills.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72860, 5, 2111002, 'Explosion', 'Creates a Fire Attribute explosion near you that attacks up to 6 monsters.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72861, 5, 2111003, 'Poison Mist', 'Temporarily creates a poisonous fog around you that deals damage to all enemies nearby.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72862, 5, 2111004, 'Seal', 'Seals up to 6 enemies nearby for a given duration. Required Skill: #cElement Amplification Lv. 3#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72863, 5, 2111005, 'Spell Booster', 'Uses MP to temporarily double the speed of Magic Attacks  Required Skill: #cElement Amplification Lv. 3#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72864, 5, 2111006, 'Element Composition', 'Uses magic that combines both Fire and Poison Attributes to attack one enemy with a chance to Poison enemies. Especially effective on enemies weak to Fire or Poison.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72865, 5, 2111007, 'Teleport Mastery', 'When activated, enemies at the teleport location will take damage and become Stunned. Also, permanently increases teleport distance.  This skill can be toggled on and off with the skill key.  Required Skill: #cTeleport Lv. 20#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72866, 5, 2111008, 'Elemental Decrease', 'Temporarily decreases the magic attributes of all attacks that you use.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72867, 5, 2210000, 'Partial Resistance', 'Increases your Ice and Lightning Resistance.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72868, 5, 2210001, 'Element Amplification', 'Increases the MP cost and the Magic Attack of your magic skills.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72869, 5, 2211002, 'Ice Strike', 'Creates an ice fragment to attack up to six enemies. Enemies that are hit become Frozen.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72870, 5, 2211003, 'Thunder Spear', 'Creates a spear imbued with the power of lightning that attacks one enemy. The spear inflicts multiple hits on an enemy at an incredibly quick speed, possibly Stunning the enemy.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72871, 5, 2211004, 'Seal', 'Seals up to 6 enemies nearby for a given duration. Required Skill: #cElemental Boost Lv. 3#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72872, 5, 2211005, 'Spell Booster', 'Uses MP to temporarily double the speed of Magic Attacks  Required Skill: #cElemental Boost Lv. 3#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72873, 5, 2211006, 'Element Composition', 'Uses magic that combines both Ice and Lightning Attributes to attack one enemy, with a chance to Freeze enemies. Especially effective on enemies weak to Ice or Lightning.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72874, 5, 2211007, 'Teleport Mastery', 'When activated, enemies at the teleport location will take damage and become Stunned. Also, permanently increases teleport distance.  This skill can be toggled on and off with the skill key.  Required Skill: #cTeleport Lv. 20#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72875, 5, 2211008, 'Elemental Decrease', 'Temporarily decreases the magic attributes of all attacks that you use.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72876, 5, 2310000, 'Elemental Resistance', 'Increases your resistance to Elemental Attacks, reducing damage dealt to you.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72877, 5, 2311001, 'Dispel', 'Nullifies all enemy magic effects within the targeted area while removing all abnormal conditions suffered by nearby party members.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72878, 5, 2311002, 'Mystic Door', 'Creates a portal that leads to the nearest town. All members of the party can use it multiple times until the portal disappears. #cPress Up arrow key# to move. Required Skill: #cDispell Lv. 3#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72879, 5, 2311003, 'Holy Symbol', 'Temporarily allows all nearby party members to gain additional EXP while hunting. Becomes more effective when there are more than 2 members nearby.  Required Skill: #cDispell Lv. 3#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72880, 5, 2311004, 'Shining Ray', 'Attacks multiple enemies at once with a ray of holy light. Deals massive damage to the Undead and Devil-type monsters.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72881, 5, 2311005, 'Doom', 'Turns multiple enemies into snails.  Changes the look, attack capacity, and movement speed of those enemies. Cannot be used against boss monsters.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72882, 5, 2311006, 'Summon Dragon', 'Summons a holy dragon for a certain amount of time.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72883, 5, 2311007, 'Teleport Mastery', 'When activated, enemies at the teleport location will take damage and become Stunned. Also, permanently increases teleport distance.  This skill can be toggled on and off with the skill key.  Required Skill: #cTeleport Lv. 20#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72884, 5, 2310008, 'Holy Focus', 'Permanently increases Critical Hit Rate for Holy Attribute skills and Heal.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72885, 5, 3110000, 'Thrust', 'Permanently increases your Speed.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72886, 5, 3110001, 'Mortal Blow', 'Has a chance to kill an enemy with a single blow.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73235, 5, 20001009, 'Bamboo Thrust', 'Use bamboo as weapon and attack.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72887, 5, 3111002, 'Puppet', 'Summons a Puppet (doppelganger) for a given duration. When the Puppet is summoned, monsters will attack the Puppet instead of you.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72888, 5, 3111003, 'Inferno', 'Fires arrows imbued with flame power to attack up to 6 monsters. Hit monsters continue to take damage after they''re hit.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72889, 5, 3111004, 'Arrow Rain', 'Fires a volley of arrows into the sky, attacking multiple monsters at once. Required skill: #cMortal Blow Lv. 5#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72890, 5, 3111005, 'Silver Hawk', 'Summons a silver hawk. The hawk will hover near you, attacking and occasionally Stunning monsters.  Required skill  #cPuppet Lv. 5#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72891, 5, 3111006, 'Strafe', 'Fires 4 arrows at an enemy.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72892, 5, 3110007, 'Evasion Boost', 'Grants you a chance to dodge enemy attacks. When you succeed, your next attack will be a Critical Hit.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72893, 5, 3210000, 'Thrust', 'Permanently increases your Speed.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72894, 5, 3210001, 'Mortal Blow', 'Has a chance to finish off an enemy with a single blow.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72895, 5, 3211002, 'Puppet', 'Summons a Puppet (doppelganger) for a given duration. When the Puppet is summoned, monsters will attack the Puppet instead of you.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72896, 5, 3211003, 'Blizzard', 'Fires an Ice arrow that damages multiple enemies. The enemy you targeted will be Frozen.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72897, 5, 3211004, 'Arrow Eruption', 'Arrows fly up from the ground, dealing damage to multiple enemies.  Required skill: #cMortal Blow Lv. 5#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72898, 5, 3211005, 'Golden Eagle', 'Temporarily summons a gold eagle that hovers around you, attacking and possibly Stunning nearby monsters.  Required Skill: #cPuppet Lv. 5#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72899, 5, 3211006, 'Strafe', 'Fires 4 arrows at an enemy.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72900, 5, 3210007, 'Evasion Boost', 'Grants you a chance to dodge enemy attacks. When you succeed, your next attack will be a Critical Hit.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72901, 5, 4110000, 'Alchemist', 'Increases the effect of the recovery items like potions and lengthens their duration. Percentage based recover items, like Elixirs, do not count.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72902, 5, 4111001, 'Meso Up', 'For a certain amount of time, everyone in the party can make enemies drop more mesos than usual. This only applies to mesos dropped by monsters.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72903, 5, 4111002, 'Shadow Partner', 'A shadow partner that mimics the summoner appears. It does not have its own HP and disappears after a fixed period of time.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72904, 5, 4111003, 'Shadow Web', 'Creates a web of shadow around you that can tangle up to 6 monsters. Once tangled, the monsters will be unable to move.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72905, 5, 4111004, 'Shadow Meso', 'Attacks enemies with mesos without consuming any mesos. Damage depends on the amount thrown. Cancels enemy''s Weapon DEF and Magic Guard buffs.  Required Skill: #cMeso Up Lv. 5#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72906, 5, 4111005, 'Avenger', 'Throws a throwing star. The throwing star will go through an enemy and attack the ones behind it, too.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (72907, 5, 4111006, 'Flash Jump', 'Allows you to double jump. The higher the skill level, the further you jump.  Required Skill: #cAvenger Lv. 5#');
