INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73025, 5, 4121009, 'Hero''s Will', 'Cures you from being Seduced. The cooldown decreases as the skill level increases.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73026, 5, 4120010, 'Expert Throwing Star Handling', '#cIncreases the damage# for Lucky Seven, Drain, Avenger and Shadow Meso. Also, there is a chance that throwing stars will not be consumed, and a chance to #crecharge 1 throwing star#. (You cannot recharge beyond the maximum number of throwing stars. Does not apply to Spirit Javelins.) When Expert Throwing Star Handling is activated, #cthe next attack will always be a Critical Attack#. Required Skill: #cSpirit Javelin Lv. 5#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73027, 5, 4221000, 'Maple Warrior', 'Increases the stats of all party members.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73028, 5, 4221001, 'Assassinate', 'While using Dark Sight, you attack an enemy''s weak spot 4 times in a row, dealing great damage. The final attack is always a fatal blow. The longer you hide, the greater the damage you do.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73029, 5, 4220002, 'Shadow Shifter', 'Grants a chance to summon a wooden doll to take damage in your place.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73030, 5, 4221003, 'Taunt', 'Provokes up to 6 enemies, increasing their DEF but also increasing the amount of EXP and items you earn for defeating them. Required Skill: #cFake Lv. 10#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73031, 5, 4221004, 'Ninja Ambush', 'Calls upon hidden allies, who attack enemies. However, this skill cannot decrease enemy HP lower than 1. Required Skill: #cFake Lv. 5#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73032, 5, 4220005, 'Venomous Stab', 'Poison is permanently applied to your dagger, so you have a choice to Poison enemies. The poison is not stackable, and the enemy''s HP cannot drop below 1.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73033, 5, 4221006, 'Smokescreen', 'Throws a smoke grenade. All parties in range will avoid damage while the smokescreen is up. [Cooldown: 6 min]');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73034, 5, 4221007, 'Boomerang Step', 'Quickly slashes multiple enemies twice, with a chance to Stun them. Permanently enhances all attack skills before your 3rd job that can be connected with Boomerang Stab.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73035, 5, 4221008, 'Hero''s Will', 'Cures you from being Seduced. The cooldown decreases as the skill level increases.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73036, 5, 4220009, 'Meso Mastery', 'Increase the amount of mesos that drop. Skills that use mesos become more efficient.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73037, 5, 1006, 'Test', 'Test');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73038, 5, 5000000, 'Bullet Time', 'Permanently increases Accuracy and Avoidability.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73039, 5, 5001001, 'Flash Fist', 'Rapidly punches enemies.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73040, 5, 5001002, 'Sommersault Kick', 'A devastating kick that accompanies a backward somersault. Attacks all enemies in the vicinity.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73041, 5, 5001003, 'Double Shot', 'Fires two consecutive bullets to the enemy. The maximum range increases as the skill level increases.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73042, 5, 5001005, 'Dash', 'Press left or right arrow twice to temporarily boost Speed and Jump. [Dash activation: ->-> or <-<- with the arrow keys.]');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73043, 5, 5100001, 'Knuckle Mastery', 'Increases the weapon mastery and accuracy of Knuckles.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73044, 5, 5101002, 'Backspin Blow', 'This skill allows you to quickly slide back and elbow multiple monsters at once to apply damage and temporarily Stun them.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73045, 5, 5101003, 'Double Uppercut', 'Performs 2 consecutive uppercuts and stuns the enemy.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73046, 5, 5101004, 'Corkscrew Blow', 'Allows you to run forward and punch multiple monsters at once.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73047, 5, 5101005, 'MP Recovery', 'Recovers MP by using up a bit of HP.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73048, 5, 5101006, 'Knuckle Booster', 'Doubles the attack speed of your weapon. Must have knuckles equipped. Required Skill: #cKnuckle Mastery Lv. 5#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73049, 5, 5101007, 'Oak Barrel', 'Put on an Oak Barrel disguise to safely navigate through monsters without being recognized. There is a small chance you''ll be caught. More effective when you''re lying down.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73050, 5, 5100008, 'Critical Punch', 'Increases your Critical Rate and the minimum Critical Damage.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73051, 5, 5100009, 'HP Boost', 'Permanently increases your Max HP.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73052, 5, 5200000, 'Gun Mastery', 'Increases the weapon mastery, accuracy, and number of bullets for guns.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73053, 5, 5201001, 'Invisible Shot', 'Attacks 3 monsters by quickly firing bullets faster than can be seen by the naked eye.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73054, 5, 5201002, 'Grenade', 'Attacks multiple monsters with a grenade. The distance the grenade travels depends on how long you hold the skill key.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73055, 5, 5201003, 'Gun Booster', 'Doubles the attack speed of your weapon. Must have a gun equipped.  Required Skill: #cGun Mastery Lv. 5#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73056, 5, 5201004, 'Blank Shot', 'This skill allows you to pretend to shoot a gun, faking out monsters by firing a flag instead Multiple monsters will temporarily be immobilized.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73057, 5, 5201005, 'Wings', 'Allows you to jump longer and further.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73058, 5, 5201006, 'Recoil Shot', 'Uses the recoil of the gun to retreat after firing. Required Skill: #cWings Lv. 5#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73059, 5, 5200007, 'Critical Shot', 'Increases your Critical Rate and the minimum Critical Damage.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73060, 5, 5110000, 'Stun Mastery', 'Increases Critical Rate when attacking Stunned enemies.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73061, 5, 5110001, 'Energy Charge', 'A set amount of energy is charged after every attack. When the energy is fully charged, you have a chance to automatically trigger the effects of Body Attack and Stance. This allows you to use energy-related skills.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73062, 5, 5111002, 'Energy Blast', 'Blasts a ball of energy to attack multiple monsters at once, possibly Stunning them. This skill can only be used your #cthe energy is fully charged#. Required Skill: #cEnergy Charge lv. 1#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73063, 5, 5111004, 'Energy Drain', 'Absorbs a portion of the monster''s HP to restore your own HP. It can only be used when your #cenergy is fully charged#.\ Required Skill: #cEnergy Charge Lv. 1#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73064, 5, 5111005, 'Transformation', 'Transforms you for 180 seconds. Some skills cannot be used when you are transformed.  [Skill Exceptions: Double Shot, Oak Barrel, Demolition, Snatch]');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73065, 5, 5111006, 'Shockwave', 'Smashes the ground to create a shock wave that damages multiple enemies. Can only be used while in the #cTransformation or Super Transformation# states.  Required Skill: #cTransformation Lv. 1#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73066, 5, 5111007, 'Roll of the Dice', 'Test your luck! Roll a dice to get a random Buff. Roll a 1 and you get nothing.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73067, 5, 5110008, 'Brawling Mastery', 'Increases the damage of Backspin Blow, Double Uppercut, and Corkscrew Blow.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73068, 5, 5210000, 'Burst Fire', 'Increases the potency and the number of bullets fired when using Double Shot. Required Skill: #cDouble Shot Lv. 20#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73069, 5, 5211001, 'Octopus', 'Summons a loyal octopus that''ll aid your attacks. The summoned octopus will not move.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73070, 5, 5211002, 'Gaviota', 'Summons Gaviota, who''s trained to throw a grenade at monsters. The summoned Gaviota will seek a monster, and when it finds one, it''ll toss the grenade and disappear.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73071, 5, 5211004, 'Flamethrower', 'Attacks a monster nearby with a fire-based attack. The affected monster will continue to take damage over time.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73072, 5, 5211005, 'Ice Splitter', 'Attacks the closest monster with an ice-based attack. The affected monster will be frozen for a short period of time.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73073, 5, 5211006, 'Homing Beacon', 'Sends a parrot that''ll mark a target on a monster. From then on out, all attacks will be focused on that monster.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73074, 5, 5211007, 'Roll of the Dice', 'Test your luck! Roll a dice to get a random Buff. Roll a 1 and you get nothing.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73075, 5, 5121000, 'Maple Warrior', 'Increases the stats of all party members.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73076, 5, 5121001, 'Dragon Strike', 'Summons a sleeping dragon from the depths of the ground damage multiple monsters.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73077, 5, 5121002, 'Energy Orb', 'Uses a blast of powerful energy to strike a monster. If there are other monsters around the affected monster, they will also be affected by this potent ball of energy. Only available when your #cenergy is fully charged#. Required Skill: #cEnergy Charge Lv. 1#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73078, 5, 5121003, 'Super Transformation', 'Super Transforms you for 180 seconds. Some skills cannot be used when you are in a Super Transformation state.  [Skill Exceptions: Double Shot, Oak Barrel] Required Skill: #cTransformation Lv. 20#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73079, 5, 5121004, 'Demolition', 'Deliver consecutive attacks to a monster by attacking it at blinding speed. Ignores a certain amount of enemy DEF. Only available when in a state of #cSuper Transformation#. Required Skill: #cSuper Transformation Lv. 1#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73080, 5, 5121005, 'Snatch', 'Damages monsters that are far away and drags them to you. Only available when in a state of #cSuper Transformation#. Required Skill: #cSuper Transformation Lv. 1#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73081, 5, 5121007, 'Barrage', 'Attacks a monster nearby 6 times in quick succession. The targeted monster is stunned until the attack is complete.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73082, 5, 5121008, 'Pirate''s Rage', 'Cures you from being Seduced. The cooldown decreases as the skill level increases.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73083, 5, 5121009, 'Speed Infusion', 'Uses HP and MP to temporarily increase the attack speed of a weapon. This can be combined with other boosters, and everyone in the party will have their attack speed doubled. Required Skill: #cKnuckle Booster Lv. 20#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73084, 5, 5121010, 'Time Leap', 'Resets the cooldown for your skills and your party member''s skills. Does not reset the cooldown of Time Leap.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73085, 5, 5120011, 'Pirate''s Revenge', 'When attacked, you have a chance to increase your attack damage. The higher the skill level, the longer the buff. Pirate''s Revenge can only proc once every 50 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73086, 5, 5221000, 'Maple Warrior', 'Increases the stats of all party members.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73087, 5, 5220001, 'Elemental Boost', 'Increases the potency of Flamethrower and Ice Splitter.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73088, 5, 5220002, 'Wrath of the Octopi', 'An additional octopus is summoned, increasing the fire rate and the damage. Required Skill: #cOctopus Lv. 30#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73089, 5, 5221003, 'Air Strike', 'Uses the grenade attack of Gaviota to damage multiple monsters.  Required Skill: #cGaviota Lv. 15#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73090, 5, 5221004, 'Rapid Fire', 'Fires rounds of bullets very quickly. Hold down the skill key to shoot longer. Required Skill: #cTriple Fire Lv. 20#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73091, 5, 5221006, 'Battleship', 'You board a pirate ship. You will have limited skills when you are on board. The durability of the ship decreases every time you take damage, and when it reaches 0, you will not be able to get back on board for a short period of time.  [Available Skills: Battleship Skills, Grenades, Gun Booster, Flamethrower, Ice Splitter, Gaviota, Octopus, Maple Warrior, Hero''s Will]');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73092, 5, 5221007, 'Battleship Cannon', 'Rapidly fires a number of cannonballs. Only available when aboard the Battleship. Grants additional Critical Rate. Required Skill: #cBattleship Lv. 1#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73093, 5, 5221008, 'Battleship Torpedo', 'Fires a hardened cannonball that goes through monsters. Only available when aboard the Battleship. Required Skill: #cBattleship Lv. 1#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73094, 5, 5221009, 'Hypnotize', 'Hypnotizes monsters to temporarily make them attack other monsters instead of you.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73095, 5, 5221010, 'Hero''s Will', 'Cures you from being Seduced. The cooldown decreases as the skill level increases.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73096, 5, 5220011, 'Bullseye', 'Increases the damage of Homing Beacon. Also, more damage is applied to monsters under the Homing Beacon effect.  Required Skill: #cHoming Beacon Lv. 20#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73097, 5, 5220012, 'Pirate''s Revenge', 'When attacked, you have a chance to increase your attack damage. The higher the skill level, the longer the buff. Pirate''s Revenge can only proc once every 50 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73098, 5, 1009, 'Bamboo Rain', 'An attack using a bamboo stick.');
