INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73100, 5, 1011, 'Power Explosion', 'Increased damage rate for a fixed amount of time.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73101, 5, 8001000, '매크로 테스트', '[마스터 레벨 : 1] 매크로로 의심되는 캐릭터를 대상으로 거짓말 탐지기를 실행한다.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73102, 5, 8001001, '텔레포트', '[마스터 레벨 : 1] 상, 하, 좌, 우 방향키를 이용하여 같은 맵 상의 다른 위치로 일정 간격으로 이동할 수 있다.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73103, 5, 11001002, 'Power Strike', 'Consumes MP to deliver powerful damage to enemies.');
