INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73118, 5, 15111003, 'Shockwave', 'Smashes the ground to create a shockwave. The shockwave penetrates and damages a number of monsters. Can only be used when #cTransformation, Super Transformation# is active.  Required Skill: #cTransformation Lv. 1#');
