INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73130, 5, 13101001, 'Bow Booster', 'Doubles the attack speed of your weapon. Must have a bow equipped. Required Skill: #cBow Mastery Lv. 5#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73131, 5, 13101002, 'Final Attack', 'Grants a chance to deal additional damage after an attack. Must have a bow equipped. Required Skill: #cBow Mastery Lv. 3#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73132, 5, 13101003, 'Soul Arrow', 'Enables you to use your bow without consuming arrows for a fixed period of time. Required Skill: #cBow Booster Lv. 5#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73133, 5, 13100004, 'Thrust', 'Permanently increases your Speed.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73134, 5, 13101005, 'Storm Break', 'Deals damage to nearby enemies and knocks them back.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73135, 5, 13101006, 'Wind Walk', 'Borrows the power of the wind to temporarily hide yourself. Attacking in Wind Walk state will deal bonus damage additional damage as well as make you visible.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73136, 5, 13111000, 'Arrow Rain', 'Fires a number of arrows into the sky, attacking up to 6 monsters at once.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73137, 5, 13111002, 'Hurricane', 'Launches arrows at a tremendous speed, like a catastrophic rainstorm. Pressing the skill key will fire arrows continuously.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73138, 5, 13110003, 'Bow Expert', 'Increases Bow Mastery, Weapon Attack, and Minimum Critical Damage. Required Skill: #cBow Mastery Lv. 20#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73139, 5, 13111004, 'Puppet', 'Summons a Puppet (doppelganger) for a given duration. When the Puppet is summoned, monsters will attack the Puppet instead of you.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73140, 5, 13111005, 'Eagle Eye', 'Transforms you into Eagle Eye, a heroic figure who was able to use his bow more freely and skillfully than anyone else! This will enhance your Speed and Jump as well as give you access to the exclusive skills of Eagle Eye.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73141, 5, 13111006, 'Wind Piercing', 'Inflicts a significant amount of damage to multiple monsters at once with a single powerful blow. Available only as Eagle Eye.  Required skill: #cEagle Eye Lv. 1#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73142, 5, 13111007, 'Wind Shot', 'Fires 3 arrows to inflict damage on monsters. Available only as Eagle Eye.  Required skill: #cEagle Eye Lv. 1#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73143, 5, 14000000, 'Nimble Body', 'Permanently increases Accuracy and Avoidability.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73144, 5, 14000001, 'Keen Eyes', 'Increases the range of throwing weapons such as the throwing knives, stars, etc.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73145, 5, 14001002, 'Disorder', 'Temporarily decreases an enemy’s Weapon Attack and Defense, eventually neutralizing the monster’s attack. Cannot be used on the same monster repeatedly.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73146, 5, 14001003, 'Dark Sight', 'Hides in shadow. With Dark Sight activated, you can neither attack nor be attacked.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73147, 5, 14001004, 'Lucky Seven', 'Throws 2 throwing stars based on LUK, regardless of Claw Mastery.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73148, 5, 14001005, 'Darkness', 'Summons a spirit to attack nearby enemies.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73149, 5, 14100000, 'Claw Mastery', 'Increases the weapon mastery and accuracy of Throwing Stars, and enhances the max number of charges.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73150, 5, 14100001, 'Critical Throw', 'Increases your Critical Rate and the minimum Critical Damage.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73151, 5, 14101002, 'Claw Booster', 'Doubles the attack speed of your weapon. Must have a Claw equipped.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73152, 5, 14101003, 'Haste', 'Temporarily boosts the Speed and Jump of the entire party.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73153, 5, 14101004, 'Flash Jump', 'Use while in the middle of a jump to jump even further. The jumping distance increases as the skill level increases.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73154, 5, 14100005, 'Vanish', 'Inflicts additional damage on monsters when used while Dark Sight is active. Dark Sight deactivates as soon as this skill is applied.  Required skill: #cDark Sight Lv. 10#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73155, 5, 14101006, 'Vampire', 'Attacks multiple enemies 4 times then absorbs some of the damage dished out to the enemy as HP. The most you can absorb at once is half of your Max HP or the monster''s total Max HP.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73156, 5, 14111000, 'Shadow Partner', 'A shadow partner that mimics the summoner appears. It does not have its own HP and disappears after a fixed period of time.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73157, 5, 14111001, 'Shadow Web', 'Creates a web of shadow around you that can tangle up to 6 monsters. Once tangled, the monsters will be unable to move.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73158, 5, 14111002, 'Avenger', 'Throws a throwing star. The throwing star will go through an enemy and attack the ones behind it, too.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73159, 5, 14110003, 'Alchemist', 'Increases the effect of the recovery items like potions and lengthens their duration. Percentage based recover items, like Elixirs, do not count.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73160, 5, 14110004, 'Venom', 'Poison is permanently applied to your Claw, giving all your attacks the chance to Poison enemies. The Poison is not stackable, and the enemy''s HP cannot drop below 1.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73161, 5, 11101004, 'Soul Blade', 'Summons and gives form to invisible Soul power to inflict damage to enemies. The higher the skill level, the more enemies you can hit at once with this skill.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73162, 5, 11101005, 'Soul Rush', 'The power of Soul allows you to move quicker than the eye can follow.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73163, 5, 11110000, 'MP Recovery Rate Enhancement', 'Restores some MP every 4 seconds, even in combat.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73164, 5, 11111001, 'Combo Attack', 'For a fixed amount of time, accumulates combo orbs with each attack. Allows you to charge 5 combo orbs max. Each combo orb increases the damage you deal.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73165, 5, 11111002, 'Panic', 'Deals damage to one monster, with a chance to cast Darkness it. Can only be used when at least one combo orb is charged. More combo orbs equals more damage.  Required Skill: #cCombo Attack Lv. 1#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73166, 5, 11111003, 'Coma', 'Powerfully strikes a group of monsters, with a chance to Stun them. Can only be used when at least one combo orb is charged. More combo orbs equals more damage. Required Skill: #cCombo Attack Lv. 1#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73167, 5, 11111004, 'Brandish', 'Perform a double attack on enemies in front of you.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73168, 5, 11110005, 'Advanced combo', 'Increases the damage dealt per combo orb and enables you to charge more orbs. Also, grants a chance to charge orbs twice as quickly. Required skill: #c Combo Attack Lv. 20#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73169, 5, 11111006, 'Soul Driver', 'Uses Soul power to attack multiple enemies four times.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73170, 5, 11111007, 'Soul Charge', 'Empowers your weapon with a Holy Attribute.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73171, 5, 12001001, 'Magic Guard', 'Damage dealt to you affects your MP instead of your HP. If your MP reaches 0, you HP take the full amount of damage.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73172, 5, 12001002, 'Magic Armor', 'Uses magic to temporarily increase Weapon DEF and Magic DEF.  Required Skill:  #cMagic Guard Lv. 3#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73173, 5, 12001003, 'Magic Claw', 'Attacks two enemies in front of you twice.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73174, 5, 12001004, 'Flame', 'Summons a spirit to attack nearby monsters.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73175, 5, 12000005, 'MP Boost', 'Permanently increases your Max MP.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73176, 5, 12101000, 'Meditation', 'Through meditation, you temporarily enhance the Magic Attack of all party members nearby.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73177, 5, 12101001, 'Slow', 'Temporarily slows the movement of up to 6 monsters. Cannot be used on the same monsters more than twice in a row. Required Skill:  #cTeleport: Lv. 5#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73237, 5, 20001011, 'Meteo Shower', 'Damage will increase for certain period of time.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73178, 5, 12101002, 'Fire Arrow', 'Creates and shoots a Fire Arrow. Especially effective against Ice Attribute monsters.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73179, 5, 12101003, 'Teleport', 'Allows you to teleport a set distance to other locations on the same map using the arrow keys.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73180, 5, 12101004, 'Spell Booster', 'Increases Magic Attack Speed for set duration.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73181, 5, 12101005, 'Elemental Reset', 'Temporarily decreases the magic attributes of all attacks that you use.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73182, 5, 12101006, 'Fire Pillar', 'Inflicts fire damage on nearby monsters. Can affect up to 6 monsters.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73183, 5, 12100007, 'Spell Mastery', 'Increases Magic Mastery and Magic Attack.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73184, 5, 12110000, 'Elemental Resistance', 'Increases your resistance to Elemental Attacks, reducing damage dealt to you.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73185, 5, 12110001, 'Element Amplification', 'Increases the MP cost and the Magic Attack of your magic skills.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73186, 5, 12111002, 'Seal', 'Seals up to 6 enemies nearby for a given duration. Required Skill: #cElemental Boost Lv. 3#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73187, 5, 12111003, 'Meteor Shower', 'Summons meteors from the sky that deal a powerful fire attack to up to 15 enemies. Enemies hit continue to take fire damage over time.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73188, 5, 12111004, 'Ifrit', 'Temporarily summons Ifrit to deal Fire damage to up to 3 monsters.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73189, 5, 12111005, 'Flame Gear', 'Temporarily creates a wall of fire. The monsters inside the wall continuously take damage.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73190, 5, 12111006, 'Fire Strike', 'Throws a huge fireball to attack up to 6 monsters.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73191, 5, 13000000, 'Critical Shot', 'Increases Critical Hit Rate.');
