INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73199, 5, 11101001, 'Sword Booster', 'Doubles the attack speed of your weapon. Must have a sword equipped.  Required Skill: #cSword Mastery Lv. 5#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73200, 5, 11101002, 'Final Attack', 'Grants a chance to deal additional damage after an attack. Must have a sword equipped.  Required Skill: #cSword Mastery Lv. 3#');
