INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73249, 5, 21100000, 'Polearm Mastery', 'Increases the weapon mastery and accuracy of polearms.  Required Skill: #cTriple Swing Lv. 3#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73250, 5, 21100002, 'Final Charge', 'Charges forward, knocking back enemies in your path. Can only be activated after using Triple Swing. [Command: Triple Swing + #cRight Arrow Key + Attack Key#] Required Skill: #c Triple Swing Lv. 20#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73251, 5, 21101003, 'Body Pressure', 'Temporarily enables Body Attacks on enemies. Attacked enemies may be Stunned for 5 seconds.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73252, 5, 21110000, 'Combo Critical', 'Increases your Critical Hit Rate. Each time yout Combo Count increases by 10, your Critical Hit Rate will also increase. Required Skill: #cCombo Ability Lv. 10#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73253, 5, 21111001, 'Smart Knockback', 'Temporarily allows you to knock-back enemies even when only a small amount of damage is dealt.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73254, 5, 21110004, 'Combo Fenrir', 'Fires the condensed energy of the wolves to attack enemies in front of you twice. Can only be used when #cCombo Count is 100 or higher#. [Command: #cDown Arrow Key and Right Arrow Key + Attack Key#] Required Skill: #cCombo Smash Lv. 10#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73255, 5, 21111005, 'Snow Charge', 'Infuses your polearm with Ice Attribute.');
