INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73260, 5, 21121003, 'Freeze Standing', 'Uses the power of Ice to hold your ground when struck, enabling you to resist being knocked back.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73261, 5, 21120004, 'High Defense', 'A new defense technique the permanently decreases damage received from enemies.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73262, 5, 21120006, 'Combo Tempest', 'Freezes the enemy so that even a small amount of impact can kill them. Inflicts deadly damage to boss monsters up to 4 consecutive times. Can only be used when #cCombo Count reaches 200#. [Command: #cDown Arrow Key and Right Arrow Key + Attack Key#] Required Skill: #cCombo Peril Lv. 20#');
