INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73283, 5, 21001001, 'Combat Step', 'Press a direction key twice to quickly move a short distance. [Command: #c->->#] Required Skill: #cDouble Swing Lv. 5#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73284, 5, 21100001, 'Triple Swing', 'Press the attack key three times to deal a triple attack on up to 12 enemies. Required Skill: #cDouble Swing Lv. 20#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73285, 5, 21100004, 'Combo Smash', 'Uses the polearm to fire a burst of energy at enemies in front of you. Can only be used when your #cCombo Count is 30 or higher#. [Command: #cDown Arrow Key and Right Arrow Key + Attack Key#] Required Skill: #cCombo Ability Lv. 1#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73286, 5, 21100005, 'Combo Drain', 'Activates a buff that absorbs a portion of damage received as HP. Can only absorb up to 10% of your Max HP. Can only be used when your #cCombo Count is 30 or higher#. [Command: #cDown Arrow Key and Down Arrow Key + Attack Key#] Required Skill: #cCombo Ability Lv. 1#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73287, 5, 21120005, 'Final Blow', 'Swings the polearm to deal a powerful attack on up to 12 enemies. Can only be used #cafter using Triple Swing#. [Command: Triple Swing + #cDown Arrow Key + Attack Key#] Required Skill: #Triple Swing Lv. 20#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73288, 5, 21120002, 'Over Swing', 'Maxes out the damage of Double Swing and Triple Swing.  Required Skill: #cFull Swing Lv. 20#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73289, 5, 21110006, 'Rolling Spin', 'Jump and spin while spinning the polearm around. Shoves monsters to the left and right. [Command: #cUp Arrow Key and Up Arrow Key + Attack Key#]');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73290, 5, 21110003, 'Final Toss', 'Lifts multiples enemies in front of you into the air. Airborne enemies take more damage. Can only be used after using Triple Swing. [Command: Triple Swing + #cUp Arrow Key + Attack Key#] Required Skill: #cTriple Swing Lv. 20#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73291, 5, 21110002, 'Full Swing', 'Increases the damage of Double Swing and Triple Swing.  Required Skill: #cTriple Swing Lv. 20#');
