INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73348, 5, 22111000, 'Lightning Bolt', 'Drops a thunderbolt on one enemy.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73349, 5, 22111001, 'Magic Guard', 'Damage dealt to you affects your MP instead of your HP. If your MP reaches 0, you HP take the full amount of damage.#cLevel 6 and above: Mastery Book required#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73350, 5, 22121000, 'Ice Breath', 'Gathers ice for a while before attacking multiple monsters. The longer you spend gathering ice, the more damage you do.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73351, 5, 22121001, 'Elemental Reset', 'Temporarily decreases the magic attributes of all attacks that you use.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73352, 5, 22120002, 'Spell Mastery', 'Increases Magic Mastery and Magic Attack.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73353, 5, 22131000, 'Magic Flare', 'A pillar of light created with a pentacle surrounds one enemy and inflicts damage.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73354, 5, 22131001, 'Magic Shield', 'Creates a protective shield that absorbs a fixed amount of damage received by party members for 20 seconds. [Cooldown: 40 sec]');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73355, 5, 22140000, 'Critical Magic', 'Increases Critical Hit Rate.#cLevel 6 and above: Mastery Book required#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73356, 5, 22141001, 'Dragon Thrust', 'A fierce dragon deals damage to enemies while knocking them back.');
