INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73358, 5, 22141003, 'Slow', 'Casts a Slow Buff. When the Slow Buff is activated, the speed of the targeted enemy has a chance to be Slowed.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73359, 5, 22150000, 'Magic Amplification', 'Increases the MP cost and the Magic Attack of your magic skills.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73360, 5, 22151001, 'Fire Breath', 'Gathers fire for a while before attacking multiple monsters. Enemies that are hit are knocked down. The longer you spend gathering fire, the more damage you do.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73361, 5, 22151002, 'Killer Wings', 'Attacks one enemy, who is then branded with a Dragon seal. All of your following attacks will be focused on that enemy.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73362, 5, 22151003, 'Magic Resistance', 'Temporarily increases the magic resistance for all party members nearby.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73363, 5, 22160000, 'Dragon Fury', 'When your MP is within a certain range, the focus of the Dragon strengthens and your Magic Attack increases. This effect disappears once your MP is out of that range.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73364, 5, 22161001, 'Earthquake', 'Violently shakes the ground, inflicting multiple attacks on enemies.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73365, 5, 22161002, 'Phantom Imprint', 'Creates a pentacle that puts a curse on a target enemy. Cursed enemies temporarily take more damage.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73366, 5, 22161003, 'Recovery Aura', 'Creates a recovery aura around you for 30 seconds. The MP of all party members inside the aura will be continuously restored. [Cooldown: 1 min]');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73367, 5, 22171000, 'Maple Warrior', 'Increases the stats of all party members.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73368, 5, 22170001, 'Magic Mastery', 'Enhances Magic Mastery, Magic Attack, and Minimum Critical Damage. Required Skill: #cSpell Mastery Lv. 10#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73369, 5, 22171002, 'Illusion', 'The dragon''s clone attacks a monster 4 times.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73370, 5, 22171003, 'Flame Wheel', 'Generates a wheel of flames that attacks up to 6 monsters at once, dealing Fire damage.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73371, 5, 22171004, 'Hero''s Will', 'Cures you from being Seduced. The cooldown decreases as the skill level increases.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73372, 5, 22181000, 'Blessing of the Onyx', 'Increases Weapon Defense, Magic Defense, and Magic Attack.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73373, 5, 22181001, 'Blaze', 'Attacks and stuns a monster with a powerful flame. Nearby monsters also take a reduced amount of damage.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73374, 5, 22181002, 'Dark Fog', 'Creates a dark, chilly fog that attacks up to 15 enemies. Grants additional critical hit rate.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73375, 5, 22181003, 'Soul Stone', 'Casts a buff that holds Souls. A character who dies whose Soul is being held will be resurrected immediately in the same location. This buff is randomly cast on party members. [Cooldown: 6 min]');
