INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73383, 5, 30001000, 'Crystal Throw', '[Master Level: 3] Throws a piece of Rue at an enemy.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73384, 5, 30001001, 'Infiltrate', '[Master Level: 3] Allows you to hide and move quickly for a short time. #cCooldown: 1 min#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73385, 5, 30000002, 'Potion Mastery', '[Master Level: 3] Because of supply shortage issues, you''ve learned to use potions more effectively.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73386, 5, 30001003, 'Legendary Spirit', '[Master Level: 1] With the aid of a legendary spirit, you can now use scrolls on items that you can''t equip.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73387, 5, 30001004, 'Monster Riding', '[Master Level: 1] Allows you to ride a tamed monster.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73388, 5, 30001005, 'Hero''s Echo', '[Master Level: 1] Increases the Weapon ATT and Magic ATT of all nearby players.  #cCooldown: 2 hrs#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73389, 5, 30001006, 'Test', 'Test');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73390, 5, 30001007, 'Maker', '[Master Level: 3] Allows you to use alchemy to create items. The items you can create depend on your character level.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73391, 5, 30001009, 'Bamboo Rain', 'Uses bamboo to attack an enemy.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73392, 5, 30001010, 'Invincibility', 'Allows you to temporarily become invincible.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73393, 5, 30001011, 'Power Explosion', 'Temporarily increases your damage.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73394, 5, 30000012, 'Blessing of the Fairy', 'Grants 1 skill level for every 10 levels your highest level character has. Each skill level grants bonus buffs. If your current character is your highest level character, this skill uses your second highest level character instead.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73395, 5, 30001013, 'Spaceship', '[Master Level: 2] Allows you to board a Spaceship. Hitting one of the direction keys (left or right) twice enhances Movement Speed and Jump.  #cExpires: Midnight on June 8th, 2009#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73396, 5, 30001014, 'Space Dash', '[Master Level: 1] Hitting one of the direction keys (left or right) twice enhances Movement Speed and Jump.  #cExpires: Midnight on June 8th, 2009#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73397, 5, 30001015, 'Space Beam', '[Master Level: 1] Allows you to change the condition of Krypto in the Space Mine. #cExpires: Midnight on June 8th, 2009#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73398, 5, 30001017, 'Yeti Mount', '[Master Level: 1] Allows you to ride a Yeti. #cExpires: Midnight on September 7th, 2009#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73399, 5, 30001018, 'Yeti Mount', '[Master Level: 1] Allows you to ride a Yeti.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73400, 5, 30001019, 'Witch''s Broomstick', '[Master Level: 1] Allows you to ride a Broomstick.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73401, 5, 30001020, 'Rage of Pharaoh', '[Master Level: 1] Utilizes the rage of Pharaoh as an attack.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73402, 5, 30000022, 'Deadly Crits', '[Master Level: 20] Grants you an increase Critical Hit Rate.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73403, 5, 30001025, 'Charge! Toy Trojan', '[Master Level: 1] Allows you to ride a Wooden Horse.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73404, 5, 30001026, 'Soaring', '[Master Level: 1] Fly through the sky with the mysterious powers of the dragon race. You will take great damage if you fall.  This skills costs 90 MP to activate and consumes 1 MP per sec while active.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73405, 5, 30001027, 'Croco', '[Master Level: 1] Allows you to ride a Croco.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73406, 5, 30001028, 'Black Scooter', '[Master Level: 1] Allows you to ride a Black Scooter.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73407, 5, 30001029, 'Pink Scooter', '[Master Level: 1] Allows you to ride a Pink Scooter.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73408, 5, 30001030, 'Nimbus Cloud', '[Master Level: 1] Allows you to ride a Nimbus Cloud.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73409, 5, 30001031, 'Balrog', '[Master Level: 1] Allows you to ride a Balrog.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73410, 5, 30001033, 'Race Kart', '[Master Level: 1] Allows you to ride a Race Kart.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73411, 5, 30001034, 'ZD Tiger', '[Master Level: 1] Allows you to ride a ZD Tiger.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73412, 5, 30001035, 'Mist Balrog', '[Master Level: 1] Allows you to ride a Mist Balrog.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73413, 5, 30001042, 'Shinjo', '[Master Level: 1] Allows you to ride Shinjo.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73414, 5, 30001044, 'Orange Mushroom', '[Master Level: 1] Allows you to ride an Orange Mushroom.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73415, 5, 30001049, 'Nightmare', '[Master Level: 1] Allows you to ride Nightmare.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73416, 5, 30001050, 'Yeti', '[Master Level: 1] Allows you to ride a Yeti.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73417, 5, 30001051, 'Ostrich', '[Master Level: 1] Allows you to ride the fastest bird on land, the Ostrich.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73418, 5, 30001052, 'Pink Bear Hot-Air Balloon', '[Master Level: 1] Allows you to ride a Pink Bear Hot-Air Balloon.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73419, 5, 30001053, 'Transformed Robot', '[Master Level: 1] Allows you to ride a Transformed Robot.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73420, 5, 30001061, 'Capture', '[Master Level: 1] Allows you to capture a monster after its HP falls below 50%. Monsters captured in the Jaguar habitat can be used as mounts. #cCooldown: 10 sec#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73421, 5, 30001062, 'Call of the Hunter', '[Master Level: 1] Allows you to randomly summon one of the monsters you''ve captured to help you.  (Does not include Jaguar.)  Required skill: Capture Lv. 1 #cCooldown: 10 sec#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73422, 5, 30001063, 'Motorcycle', '[Master Level: 1] Allows you to ride a Motorcycle.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73423, 5, 30001064, 'Power Suit', '[Master Level: 1] Allows you to equip a Power Suit.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73424, 5, 30001068, 'Mechanic Dash', 'Press left/right twice to travel a short distance at a high speed. [Command: #c->->#]');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73425, 5, 30008000, 'Decent Haste', '[Potential Skill] Temporarily increases your Movement Speed and Jump.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73426, 5, 30008001, 'Decent Mystic Door', '[Potential Skill] Creates a portal that leads to the nearest town. You (and only you) can use it multiple times until it disappears. Press Up arrow key to use it.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73427, 5, 30008002, 'Decent Sharp Eyes', '[Potential Skill] Allows you to locate an enemy''s weak spot to deal fatal damage to that enemy.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73428, 5, 30008003, 'Decent Hyper Body', '[Potential Skill] Increases Max HP and Max MP.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73429, 5, 32001000, 'Triple Blow', 'Quickly attacks multiple enemies 3 times in a row.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73430, 5, 32001001, 'The Finisher', 'Inflicts damage on enemies in front of you by firing a ray of light in the shape of a saw wheel. Can only be used after a Blow type skill. Deals more damage when used alongside a high level Blow type skill.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73431, 5, 32001002, 'Teleport', 'Allows you to teleport a set distance to other locations on the same map using the arrow keys.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73432, 5, 32001003, 'Dark Aura', 'You emanate a mysterious aura that increases the damage done by your party members. Cancel the aura by pressing the skill key again. Cannot be used simultaneously with other auras.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73433, 5, 32101000, 'Quad Blow', 'Quickly deals 4 attacks on multiple enemies. Required Skill: #cTriple Blow lv. 20#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73434, 5, 32101001, 'Dark Chain', 'A dark chain emerges from a pentacle to pull multiple enemies toward you. Pulled enemies take damage and have a chance to be Knocked Down.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73435, 5, 32101002, 'Blue Aura', 'You emanate a bright blue aura that absorbs the damage taken by party members. Cancel the aura by pressing the skill key again. Cannot be used simultaneously with other auras.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73436, 5, 32101003, 'Yellow Aura', 'You emanate a bright yellow aura that increases the Movement Speed and Attack Speed of your party members. Cancel the aura by pressing the skill key again. Cannot be used simultaneously with other auras.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73437, 5, 32101004, 'Blood Drain', 'Casts a buff that allows you to recover HP equivalent to a portion of the damage you inflict on enemies. Only up to 10% of your Max HP can be recovered with each attack.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73438, 5, 32101005, 'Staff Boost', 'Doubles the attack speed of your weapon. Must have a staff equipped. Required Skill: #cStaff Mastery Lv. 5#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73439, 5, 32100006, 'Staff Mastery', 'Increases Staff Mastery, Magic Attack, and Critical Hit Rate.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73440, 5, 32110000, 'Advanced Blue Aura', 'Permanently increases your Abnormal Status and Elemental resistances while increasing the power of your Blue Aura. Also increases the DEF of nearby party members when you''re using Blue Aura. Required Skill: #cBlue Aura Lv. 20#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73441, 5, 32110001, 'Battle Mastery', 'You''ve honed your skills in battle and have now permanently increase your Damage and your Minimum Critical Damage.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73442, 5, 32111002, 'Quintuple Blow', 'Quickly deals 5 attacks on multiple enemies. Required Skill: #cQuad Blow Lv. 20#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73443, 5, 32111003, 'Dark Shock', 'Summons two dark orbs and creates a magnetic field between them, which attacks multiple enemies. Increases Critical Hit Rate. Cooldown decreases as your skill level increases.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73444, 5, 32111004, 'Conversion', 'Consumes MP to rapidly increase your Max HP for a fixed period of time.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73445, 5, 32111005, 'Body Boost', 'Consumes MP to rapidly increase the effects of your active aura. You must first cancel this skill to switch auras.  Required Skill: Dark Aura Lv. 10, Blue Aura Lv, 10, Yellow Aura Lv. 10.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73446, 5, 32111006, 'Summon Reaper Buff', 'A chance to summon a Reaper when you attack a monster. The Reaper will attack nearby monsters when summoned.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73447, 5, 32111010, 'Teleport Mastery', 'When activated, enemies at the teleport location will take damage and become Stunned. Also, permanently increases teleport distance.  This skill can be toggled on and off with the skill key.  Required Skill: #cTeleport Lv. 15#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73448, 5, 32111011, 'Advanced Dark Chain', 'Pulls enemies towards you using an even stronger dark chain. Pulled enemies take damange and have a chance to be Knocked Down.  Required Skill: #Dark Chain lv. 20#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73449, 5, 32120000, 'Advanced Dark Aura', 'Permanently increases your Magic Attack and upgrades your Dark Aura skill. When using Dark Aura, nearby enemies will take continuous damage, but you will not be able to deliver basic attacks when the enemy''s HP reaches 1. Required Skill: #cDark Aura Lv. 20#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73450, 5, 32120001, 'Advanced Yellow Aura', 'Permanently increases your Avoidability and upgrades your Yellow Aura skill. You''ll grant extra Avoidability to party members and decrease enemy Movement Speed when using Yellow Aura. Required Skill: #cYellow Aura Lv. 20#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73451, 5, 32121002, 'Finishing Blow', 'Quickly deals 6 attacks on multiple enemies. Required Skill: #cQuintuple Blow Lv. 20#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73545, 5, 10001040, 'Gargoyle', '[Master Level : 1] Lets you travel while mounted on a Gargoyle.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73452, 5, 32121003, 'Twister Spin', 'You spin at an incredible speed, creating a twister that deals damage to nearby enemies. While you''re a twister, you''re invincible. Level up the skill to decrease the skill''s cooldown.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73453, 5, 32121004, 'Dark Genesis', 'Uses the power of darkness to attack and possibly stun up to 15 enemies at once. If you''ve learned Dark Shock, that skill''s damage will also permanently increase.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73454, 5, 32121005, 'Stance', 'With great concentration, you hold your ground when struck, resisting knock-back effects.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73455, 5, 32121006, 'Party Shield', 'Creates a protective wall centered around you to protect party members. Party members behind the wall will not take damage. #cCooldown: 7 min#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73456, 5, 32121007, 'Maple Warrior', 'Increases the stats of all party members.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73457, 5, 32121008, 'Hero''s Will', 'Cures you from being Seduced. The cooldown decreases as the skill level increases.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73458, 5, 32120009, 'Energize', 'You''ve become energized, increasing your Max HP and DEF!');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73459, 5, 33001000, 'Triple Shot', 'Quickly fires three consecutive arrows.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73460, 5, 33001001, 'Jaguar Rider', 'Summons a tamed Jaguar for you to ride. When mounted, your Max HP, Critical Rate, Avoidability, and Movement Speed increases.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73461, 5, 33001002, 'Jag Jump', 'Your Jaguar double jumps a set distance.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73462, 5, 33001003, 'Crossbow Booster', 'Doubles the attack speed of your weapon. Must have a Crossbow equipped.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73463, 5, 33100000, 'Crossbow Mastery', 'Increases the weapon mastery and accuracy of Crossbows.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73464, 5, 33101001, 'Ricochet', 'Attacks multiple enemies by firing penetrating arrows equipped with bombs. Has a chance to Stun enemies.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73465, 5, 33101002, 'Jaguar Rawr', 'Deals damage to multiple enemies in front of you. Any enemies knocked back by your Jaguar''s RAWR will also be Stunned. Good kitty.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73466, 5, 33101003, 'Soul Arrow: Crossbow', 'Allows you to use your Crossbow without spending ammo for a fixed amount of time.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73467, 5, 33101004, 'It''s Raining Mines', 'You drop mines at fixed intervals while moving. The mines explode after a while, showering damage to nearby enemies.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73468, 5, 33101005, 'Jaguar-oshi', 'Your Jaguar swallows an enemy. Then, your Jaguar can either spit the enemy out to hit and damage multiple enemies or swallow the enemy to buff you. [Cooldown: 30 sec]');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73469, 5, 33101006, 'Jaguar-oshi', 'Your Jaguar swallows an enemy. Then, your Jaguar can either spit the enemy out tohit and damage multiple enemies or swallow the enemy to buff you. [Cooldown: 30 sec]');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73470, 5, 33101007, 'Jaguar-oshi', 'Your Jaguar swallows an enemy. Then, your Jaguar can either spit the enemy out tohit and damage multiple enemies or swallow the enemy to buff you. [Cooldown: 30 sec]');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73471, 5, 33101008, 'It''s Raining Mines(hidden self-destruct)', 'You drop mines at fixed intervals while moving. The mines explode after a while, showering damage to nearby enemies.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73472, 5, 33100009, 'Final Attack', 'Grants a chance to deal additional damage after an attack. Must have a crossbow equipped. Required Skill: #cCrossbow Mastery Lv. 3#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73473, 5, 33110000, 'Jaguar Boost', 'Further enhances the Jaguar Rider skill.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73474, 5, 33111001, 'Enduring Fire', 'Quickly fires five consecutive arrows.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73475, 5, 33111002, 'Dash ''n Slash', 'The Jaguar charges forward and attacks multiple enemies, possibly stunning them.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73476, 5, 33111003, 'Wild Trap', 'Summons a trap that attacks nearby enemies. The trap is so alluring that monsters attack it instead of you.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73477, 5, 33111004, 'Blind', 'Shoots at the eyes of a monster, possibly causing Blindness to decrease the monster''s Accuracy.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73478, 5, 33111005, 'Silver Hawk', 'Summons a silver hawk that hovers around you, attacking and possibly Stunning monsters nearby.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73479, 5, 33111006, 'Swipe', 'Your Jaguar consecutively swipes nearby enemies, absorbing some of the damage dealt as HP for you. You cannot absorb more than 15% of your Max HP or more than the enemy''s Max HP.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73480, 5, 33120000, 'Crossbow Expert', 'Increases Crossbow Mastery, Weapon Attack, and Minimum Critical Damage. Required Skill: #cCrossbow Mastery Lv. 20#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73481, 5, 33121001, 'Exploding Arrows', 'Summons a giant, jagged, wheel-shaped arrow that attacks multiple enemies.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73482, 5, 33121002, 'Sonic Roar', 'The Jaguar roars sharply. The roar creates a shock wave that damages and stuns multiple enemies.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73483, 5, 33121004, 'Sharp Eyes', 'Temporarily grants party members the ability to locate an enemy''s weak spot to deal fatal damage to that enemy.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73484, 5, 33121005, 'Stink Bomb Shot', 'Launches an arrow with a gaseous bomb attached to it. Monsters hit by it are pissed off and you earn more EXP from defeating them.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73485, 5, 33121006, 'Feline Berserk', 'Your Jaguar appears to spout red wings, increasing Max HP, ATT, and Movement Speed. [Cooldown: 4 min]');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73486, 5, 33121007, 'Maple Warrior', 'Increases the stats of all party members.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73487, 5, 33121008, 'Hero''s Will', 'Cures you from being Seduced. The cooldown decreases as the skill level increases.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73488, 5, 33121009, 'Wild Arrow Blast', 'Launches arrows at a tremendous speed, like a catastrophic rainstorm. Pressing the skill key will fire arrows continuously.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73489, 5, 33120010, 'Wild Instinct', 'You ignore a portion of an enemy''s defense when attacking. Also, you have a chance to dodge enemy attacks.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73490, 5, 35001001, 'Flame Launcher', 'Launches flames to simultaneously attack multiple enemies. You can use this skill for #c8 seconds, max#. Required Skill: #cGatling Gun Lv. 10#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73491, 5, 35001002, 'Mech: Prototype', 'Allows you to summon and mount the <Prototype> Mech, which greatly increases your Max HP, Max MP, ATT, DEF, and the range of your downward jumps. When attacked, you will gain a Power Stance effect.  Hit the skill key to mount/unmount.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73492, 5, 35001003, 'ME-07 Drillhands', 'Uses drill arms to push and attack enemies. Required Skill: #cMech Protoype Lv. 1#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73493, 5, 35001004, 'Gatling Gun', 'Focuses your Gatling Gun on a single enemy.  Required Skill: #cMech Protoype Lv. 1#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73494, 5, 35100000, 'Mechanic Mastery', 'Permanently increases your Weapon Attack, Weapon Mastery, and Accuracy.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73495, 5, 35101003, 'Atomic Hammer', 'The Mech uses its built-in atomic force to slam its fist to the ground. Deals great damage to enemies in front of you, possibly Stunning them.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73496, 5, 35101004, 'Rocket Booster', 'Uses rocket power to jump. When you land, you deal damage to enemies in range. Consumes MP when you launch and when you land.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73497, 5, 35101005, 'Open Portal: GX-9', 'Installs Portal <GX-9>. Up to two portal can be opened at once, and party members can freely move between them. Will not work if the two portals are too far apart.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73498, 5, 35101006, 'Mechanic Rage', 'Temporarily doubles your Attack Speed.  Required Skill: #cMechanic Mastery lv. 5#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73546, 5, 20001040, 'Gargoyle', '[Master Level : 1] Lets you travel while mounted on a Gargoyle.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73499, 5, 35101007, 'Perfect Armor', 'Your Mech has been upgraded with two new abilities.  They can be #ctoggled on/off# by using the skill key. Required Skill: #cMech: Protoype Lv. 10#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73500, 5, 35100008, 'Heavy Weapon Mastery', 'Greatly enhances the Gatling Gun and Flame Launcher skills.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73501, 5, 35101009, 'Enhanced Flame Launcher', 'Launches flames to simultaneously attack multiple enemies. You can use this skill for #c8 seconds, max#. Required Skill: #cGatling Gun Lv. 10#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73502, 5, 35101010, 'Enhanced Gatling Gun', 'Focuses your Gatling Gun on a single enemy.  Required Skill: #cMech Protoype Lv. 1#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73503, 5, 35111001, 'Satellite', 'Summons <Satellites>, tiny attack devices controlled remotely. They attack the monsters you''re attacking. Up to 3 Satellites can be summoned. Cancel the summons be pressing the skill key again.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73504, 5, 35111002, 'Rock ''n Shock', 'Installs up to 3 <Tesla Coils> to continuously attack and possibly stun enemies. They self-destruct when they run out of power.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73505, 5, 35111004, 'Mech: Siege Mode', 'Your Mech switches to <Siege> mode to optimize firepower. Only basic attacks can be used during Siege mode. Increase the Critical Hit Rate of all attack. [To Attack: #cAttack key#]');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73506, 5, 35111005, 'Acceleration Bot EX-7', 'You summon bot EX-7 to increase the Movement Speed of all monsters on the map but decrease their DEF. EX-7 will self-destruct when it runs out of power.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73507, 5, 35111009, 'Satellite', 'Summons <Satellites>, tiny attack devices controlled remotely. They attack the monsters you''re attacking. Up to 3 Satellites can be summoned. Cancel the summons be pressing the skill key again.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73508, 5, 35111010, 'Satellite', 'Summons <Satellites>, tiny attack devices controlled remotely. They attack the monsters you''re attacking. Up to 3 Satellites can be summoned. Cancel the summons be pressing the skill key again.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73509, 5, 35111011, 'Healing Robot H-LX', 'Summons the stationary bot <H-LX> stationary to heal nearby party members with its special built-in detection sensor. Once healed, party member cannot receive another heal for 2 seconds. The H-LX self-destructs when it runs out of power.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73510, 5, 35111013, 'Roll of the Dice', 'Test your luck! Roll a dice to get a random Buff. Roll a 1 and you get nothing.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73511, 5, 35110014, 'Metal Fist Mastery', 'Increases damage of the ME-07 Drillhands and Atmoic Hammer skills.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73512, 5, 35111015, 'Punch Launcher', 'Launches a punch that hits multiple enemies, possibly Stunning them.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73513, 5, 35120000, 'Extreme Mech', 'Further enhances the ATT, DEF, Max HP, Max MP, and Weapon Mastery of your Mech. Required Skill: #cMech: Prototype Lv. 10#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73514, 5, 35120001, 'Robot Mastery', 'Increases the ATT, self-destruct damage, and summon duration of all summoned robots.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73515, 5, 35121003, 'Giant Robot SG-88', 'Summons giant robot SG-88 to attack all nearby enemies. An activation gauge pops up when this robot is summoned, and damage can be charged and amplified (up to two times the base amount) by hitting the regular attack key.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73516, 5, 35121005, 'Mech: Missile Tank', 'Activates <Missile Tank> mode during which your meach continuously consumes MP to gain an increased Critical Hit Rate. You can use Seige Mode during Missile Tank mode for increased damage.  Get on/off your mount by pressing the skill key.  [To shoot: [#cAttack key#] [Skills that can be used: #cLaser Blast, Siege Mode#] Required Skill: #cMech: Siege Mode Lv. 10#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73517, 5, 35121006, 'Satellite Safety', 'Permanently increases Satellite attack damage. When you take a fatal blow, a Satellite can minimize the damage you take by absorbing some of the damage. The Satellite will then disappear and the skill will be on cooldown.  Toggle this skill #cOn/Off# by pressing the skill key. Required Skill: #cSatellite Lv. 10#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73518, 5, 35121007, 'Maple Warrior', 'Increases the stats of all party members.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73519, 5, 35121008, 'Hero''s Will', 'Cures you from being Seduced. The cooldown decreases as the skill level increases.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73520, 5, 35121009, 'Bots ''n Tots', 'Installs a robot factory that summons toy robots. Summoned robots detect nearby enemies and triggers a self-destruct function. The factory itself also self-destructs after a certain period of time.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73521, 5, 35121010, 'Amplifier Robot AF-11', 'The stationary amplifier robot <AF-11> is summoned to enhance the damage of all party members. AF-11 self-destructs when it runs out of power.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73522, 5, 35121012, 'Laser Blast', 'Shoots a laser beam that attacks multiple enemies. This skill can only be used during a Missile Tank mode. Required Skill: #cMech: Missile Tank Lv. 1#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73523, 5, 35121013, 'Mech: Siege Mode', 'Your Mech switches to <Siege> mode to optimize firepower. Only basic attacks can be used during Siege mode. Increase the Critical Hit Rate of all attack. When attacked, you will gain a Stance effect. [To Attack: #cAttack key#]');
