INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73587, 5, 8001, 'Decent Mystic Door', '[Hidden Item Skill] Generates a portal that leads to the closest town. You can enter and exit through the door as frequently as you wish until it disappears. Use the portal by pressing the ↑ button while standing on it.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73588, 5, 8002, 'Decent Sharp Eyes', '[Potential Skill] Allows you to locate an enemy''s weak spot to deal fatal damage to that enemy.');
