INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73592, 5, 4301002, 'Katara Booster', 'Doubles the attack speed of your weapon. Must have a Katara equipped.  Required Skill: #cKatara Mastery lv. 5#');
