INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73596, 5, 4310004, 'Shadow Resistance', 'With the help of the Darkness, Max HP, Abnormal Status Resistance, and Elemental Resistance are permanently increased.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73597, 5, 4321000, 'Tornado Spin', 'Quickly dashes forward with a spinning attack to deal damage to multiple enemies. [Dash Activation: Arrow keys #c->-># or #c<-<-#, Spin Attack: #cHit attack key while dashing#] Level 20 effects: Links to Flying Assaulter Lv. 10 Required: #cthe Level 6: Mastery Book#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73598, 5, 4321001, 'Tornado Spin (Attack)', 'Quickly dashes forward with a spinning attack to deal damage to multiple enemies. [Dash Activation: Arrow keys #c→→# or #c←←#, Spin Attack: #cHit attack key while dashing#] Level 20 effects: Links to Flying Assaulter Lv. 10 Required: #cthe Level 6: Mastery Book');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73599, 5, 4321002, 'Flashbang', 'Throws a flash bang to temporarily blind multiple monsters, with a chance to decrease the enemy Accuracy Rate');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73600, 5, 4321003, 'Flash Jump', 'Use while in the middle of a jump to jump even further. The jumping distance increases as the skill level increases.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73601, 5, 4331000, 'Bloody Storm', '[Master Level: 10] An advanced version of Slash Storm. Attacks multiple enemies at a very high speed with elaborate movements.  Required skill: #cLv. 20 Slash Storm# Lv.10 effect: Can be used with Lv.10 Flying Assaulter');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73602, 5, 4330001, 'Advanced Dark Sight', 'Attacks multiple nearby enemies. The attacks become more elaborate as the skill level increases. #cLv.6 or above: Mastery Book required# Lv.20 effect: #cIII+ Can learn Bloody Storm.#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73603, 5, 4331002, 'Mirror Image', 'Summons a doppelganger that looks just like you to assist in attacks for a certain amount of time. Your doppelganger cannot use certain skills. #cLv.11 or above: Master Book required##');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73604, 5, 4331003, 'Owl Spirit', 'Summons an owl spirit that attempts to instantly kill 1 enemy. If successful, your attack rate for a set number of attacks will increase.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73605, 5, 4331004, 'Upper Stab', 'Launches multiple enemies into the air. You can deal additional damage by attacking the enemies in the air.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73606, 5, 4331005, 'Flying Assaulter', 'You descend diagonally from the air, slashing enemies within a certain range, with a chance to stun them. To use the skill, you must have at least #c120%# Jump. Required Skill: #cLv. 20 Self Haste# Lv.10 effect: Lv.20 Tornado Spin can be used with Lv.10 Bloody Storm #cLv.6 or above: Mastery Book required#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73607, 5, 4341000, 'Maple Warrior', 'Increases the stats of all party members.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73608, 5, 4340001, 'Venom', 'Your dagger is permanently coated with venom. Enemies have a chance to be poisoned by the venom and continuously take damage. Can stack up to 3 times. The enemy''s HP will not go below 1 through Venom. #cLv.11 or above: Mastery Book required##');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73609, 5, 4341002, 'Final Cut', 'Sacrifices a significant amount of HP to deal powerful damage on multiple enemies. When Final Cut is used, some skills temporarily deal increased damage. The higher the skill level of this skill, the more damage some of your attack skills do.');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73610, 5, 4341003, 'Monster Bomb', 'Sticks an explosive charm on 1 monster to create a powerful explosion. The explosion occurs 3 seconds after the charm is activated, and anyone in range takes damage, enemy and ally alike. #cLv.11 or above: Mastery Book required#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73611, 5, 4341004, 'Sudden Raid', 'Summons the power of the former Blade Master and deals powerful damage on groups of up to 15 enemies. Enemies take damage over time, too.  #cLv.11 or above: Mastery Book required#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73612, 5, 4341005, 'Chains of Hell', 'When you have Dark Sight active, Chains of Hell pulls an enemy close to deal damage by attacking up to 10 times with an increased Critical Hit Rate. However, stationary monsters have to be in range.  #cLv.11 or above: Mastery Book required#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73613, 5, 4341006, 'Mirrored Target', 'Permanently increases your Defense and Avoidability. Also, disassembles the doppelganger summoned via Mirror Image and turns it into a dummy. The dummy attracts the enemy''s attacks, protecting you from them. This skill can only be used when Mirror Image is active. Required Skill: #cLv. 30 Mirror Image# #cLv.11 or above: Mastery Book required#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73614, 5, 4341007, 'Thorns', 'Grants a higher chance of getting critical attacks for you and your party members.  #cLv.11 or above: Mastery Book required#');
INSERT INTO template_data.string_wz (uid, type, template_id, name, description_clean) VALUES (73615, 5, 4341008, 'Hero''s Will', 'Cures you from being Seduced. The cooldown decreases as the skill level increases.');
